enu.'=>'მოწოდებული მენიუ არ არის სწორი მენიუ.','Add New Pattern'=>'დაამატეთ ახალი ნიმუში','Page trashed.'=>'გვერდი წაშლილებშია.','Whether the theme is a block-based theme.'=>'არის თუ არა თემა ბლოკზე დაფუძნებული თემა.','Pattern published.'=>'გამოქვეყნდა ნიმუში.','Edit Block Pattern'=>'ბლოკის ნიმუშის რედაქტირება','New Pattern'=>'ახალი ნიმუში','Invalid strategy `%1$s` defined for `%2$s` during script registration.'=>'არასწორი სტრატეგია `%1$s` განსაზღვრულია `%2$s`-სთვის სკრიპტის რეგისტრაციისას.','Expand search field'=>'გააფართოვეთ საძიებო ველი','custom backgroundBackground'=>'ფონი','template part areaFooter'=>'ბოლოსართი','template part areaGeneral'=>'საერთო','custom image headerHeader'=>'თავსართი','template part areaHeader'=>'თავსართი','block categoryPatterns'=>'შაბლონები','Template nameSearch Results'=>'ძებნის შედეგები','Get Involved'=>'შემოგვიერთდით','Attachment Pages'=>'დანართის გვერდები','Template namePage: 404'=>'გვერდი: 404','Template nameTag Archives'=>'ჭდეების არქივი','Template nameDate Archives'=>'თარიღის არქივი','Template nameCategory Archives'=>'კატეგორიის არქივები','Template nameAuthor Archives'=>'ავტორის არქივი','Template nameAll Archives'=>'ყველა არქივი','Template nameSingle Entries'=>'ერთჯერადი ჩანაწერები','Template nameBlog Home'=>'ბლოგი მთავარი','Displays when a visitor views the dedicated page that exists for any media attachment.'=>'ჩანს როცა ვიზიტორი ათვალიერებს სპეციალურ გვერდს, რომელიც არსებობს ნებისმიერი მიბმული ფაილისთვის.','Displays a post tag archive. This template will serve as a fallback when a more specific template (e.g. Tag: Pizza) cannot be found.'=>'აჩვენებს პოსტის ტეგების არქივებს. ეს შაბლონი გამოყენებული იქნება მაშინ, როცა უფრო სპეციფიური შაბლონი (მაგ. ტეგი: პიცა) არ მოიძებნება.','Displays a post archive when a specific date is visited (e.g., example.com/2023/).'=>'აჩვენებს პოსტების არქივს, როცა სპეციფიური თარიღზე მოხდება შესვლა (მაგ. example.com/2023/).','Displays when a visitor views a non-existent page, such as a dead link or a mistyped URL.'=>'გამოისახება, როდესაც მნახველი ეწვევა არარსებულ გვერდს, მაგალითად გაუქმებულ ბმულს ან არასწორად შეყვანილ URL მისამართს.','Displays when a visitor performs a search on your website.'=>'გამოისახება როდესაც მნახველი ასრულებს საძიებო მოქმედებას თქვენს ვებ-გვერდზე.','Displays your site\'s Privacy Policy page.'=>'აჩვენებს თქვენი საიტის კონფიდენციალურობის პოლიტიკის გვერდს.','Displays a custom taxonomy archive. Like categories and tags, taxonomies have terms which you use to classify things. For example: a taxonomy named "Art" can have multiple terms, such as "Modern" and "18th Century." This template will serve as a fallback when a more specific template (e.g. Taxonomy: Art) cannot be found.'=>'აჩვენებს მორგებული ტაქსონომიის არქივს. კატეგორიებისა და ტეგების მსგავსად, ტაქსონომიებს აქვთ ტერმინები, რომლებსაც იყენებთ საგნების კლასიფიკაციისთვის. მაგალითად: ტაქსონომიას სახელად „ხელოვნება“ შეიძლება ჰქონდეს მრავალი ტერმინი, როგორიცაა „თანამედროვე“ და „მე-18 საუკუნე“. ეს შაბლონი გამოდგება, როდესაც უფრო კონკრეტული შაბლონი (მაგ. ტაქსონომია: ხელოვნება) ვერ მოიძებნება.','Displays a post category archive. This template will serve as a fallback when a more specific template (e.g. Category: Recipes) cannot be found.'=>'აჩვენებს პოსტის კატეგორიის არქივს. ეს შაბლონი გამოდგება, როდესაც უფრო კონკრეტული შაბლონი (მაგ. კატეგორია: რეცეპტები) ვერ მოიძებნება.','Displays a single author\'s post archive. This template will serve as a fallback when a more specific template (e.g. Author: Admin) cannot be found.'=>'აჩვენებს ერთი ავტორის პოსტის არქივს. ეს შაბლონი გამოდგება, როდესაც უფრო კონკრეტული შაბლონი (მაგ. ავტორი: ადმინ) ვერ მოიძებნება.','Displays any archive, including posts by a single author, category, tag, taxonomy, custom post type, and date. This template will serve as a fallback when more specific templates (e.g. Category or Tag) cannot be found.'=>'აჩვენებს ნებისმიერ არქივს, მათ შორის ერთი ავტორის პოსტებს, კატეგორიას, ტეგს, ტაქსონომიას, პერსონალური პოსტის ტიპსა და თარიღს. ეს შაბლონი გამოდგება, როდესაც უფრო კონკრეტული შაბლონები (მაგ. კატეგორია ან ტეგი) ვერ მოიძებნება.','Displays a static page unless a custom template has been applied to that page or a dedicated template exists.'=>'აჩვენეთ ყველა სტატიკური გვერდი, გარდა იმ შემთხვევისა, როდესაც მორგებული შაბლონი იქნა გამოყენებული ან გამოყოფილი შაბლონი არ არსებობს.','Displays a single post on your website unless a custom template has been applied to that post or a dedicated template exists.'=>'აჩვენებს ცალკეულ პოსტებს თქვენს ვებსაიტზე, გარდა იმ შემთხვევისა, როდესაც ამ პოსტზე გამოყენებულია მორგებული შაბლონი ან არ არსებობს სპეციალური შაბლონი.','Displays any single entry, such as a post or a page. This template will serve as a fallback when a more specific template (e.g. Single Post, Page, or Attachment) cannot be found.'=>'აჩვენებს ნებისმიერ ერთ ჩანაწერს, როგორიცაა პოსტი ან გვერდი. ეს შაბლონი გამოდგება, როდესაც უფრო კონკრეტული შაბლონი (მაგ. ერთი პოსტი, გვერდი ან დანართი) ვერ მოიძებნება.','Used as a fallback template for all pages when a more specific template is not defined.'=>'გამოიყენება როგორც დამხმარე შაბლონი ყველა გვერდისთვის, როდესაც უფრო კონკრეტული შაბლონი არ არის განსაზღვრული.','Displays your site\'s homepage, whether it is set to display latest posts or a static page. The Front Page template takes precedence over all templates.'=>'აჩვენებს თქვენი საიტის მთავარ გვერდს, იქნება ეს უახლესი პოსტების ჩვენებაზე თუ სტატიკური გვერდისთვის. წინა გვერდის შაბლონს უპირატესობა აქვს ყველა შაბლონს.','Displays the latest posts as either the site homepage or as the "Posts page" as defined under reading settings. If it exists, the Front Page template overrides this template when posts are shown on the homepage.'=>'აჩვენებს უახლეს პოსტებს, როგორც საიტის მთავარ გვერდს ან როგორც "პოსტების გვერდს", როგორც ეს განსაზღვრულია წაკითხვის პარამეტრების ქვეშ. თუ ის არსებობს, წინა გვერდის შაბლონი უგულებელყოფს ამ შაბლონს, როდესაც პოსტები გამოჩნდება მთავარ გვერდზე.','Block pattern categoryPosts'=>'ჩანაწერები'