 (%3$s) იქნება %4$s, %5$s მოცემული.','The block types which can use this pattern.'=>'ბლოკის ტიპები, რომლებსაც შეუძლიათ გამოიყენონ ეს ნიმუში.','Download file'=>'გადმოწერეთ ფაილი','Invalid attribute name.'=>'ატრიბუტის სახელი არასწორია.','https://wordpress.org/documentation/article/manage-wordpress-widgets/'=>'https://wordpress.org/documentation/article/manage-wordpress-widgets/','Sorry, replies to unapproved comments are not allowed.'=>'უკაცრავად, დაუმტკიცებელ კომენტარებზე პასუხები დაუშვებელია.','Arguments cannot be prepared as both an Identifier and Value. Found the following conflicts: %s'=>'არგუმენტები არ შეიძლება მომზადდეს როგორც იდენტიფიკატორიც და მნიშვნელობაც. ნაპოვნია შემდეგი კონფლიქტები: %s','Values for the input array must be either objects or arrays.'=>'შეყვანის მასივის მნიშვნელობები უნდა იყოს ობიექტები ან მასივები.','The image already has the requested size.'=>'სურათს უკვე აქვს მოთხოვნილი ზომა.','Block pattern categoryCall to Action'=>'მოქმედებისკენ მოწოდება','Block pattern categoryContact'=>'კონტაქტები','Block pattern categoryPortfolio'=>'ნამუშევრები','https://wordpress.org/documentation/article/css/'=>'https://wordpress.org/documentation/article/css/','Introduce yourself.'=>'წარადგინეთ საკუთარი თავი.','A variety of footer designs displaying information and site navigation.'=>'ქვედაბოლოების მრავალფეროვანი დიზაინი, რომელიც აჩვენებს ინფორმაციას და საიტის ნავიგაციას.','Patterns containing mostly text.'=>'შაბლონები, რომლებიც ძირითადად ტექსტს შეიცავს.','Patterns that contain buttons and call to actions.'=>'შაბლონები, რომლებიც შეიცავს ღილაკებს და მოქმედებებისკენ მოწოდებას.','untitled post %s'=>'უსათაურო პოსტი %s','Untitled post %d'=>'უსათაურო პოსტი %d','A variety of header designs displaying your site title and navigation.'=>'სხვადასხვა სათაურის დიზაინი, რომელიც აჩვენებს თქვენი საიტის სახელს და ნავიგაციას.','Different layouts for displaying images.'=>'სხვადასხვა განლაგება სურათების ჩვენებისთვის.','Sections whose purpose is to trigger a specific action.'=>'სექ