ნაცვლად გამოიყენეთ `style_handles`.','Public facing script handle. DEPRECATED: Use `view_script_handles` instead.'=>'საჯარო სკრიპტის სახელური. მოძველებულია: ამის ნაცვლად გამოიყენეთ `view_script_handles`.','Revisions not enabled.'=>'რევიზიები არ არის ჩართული.','The icon for the post type.'=>'ხატულა პოსტის ტიპისთვის.','The slug of the template to get the fallback for'=>'შაბლონის შლაკს სარეზერვო საშუალება','The template prefix for the created template. This is used to extract the main template type, e.g. in `taxonomy-books` extracts the `taxonomy`'=>'შაბლონის პრეფიქსი შექმნილი შაბლონისთვის. ეს გამოიყენება შაბლონის ძირითადი ტიპის ამოსაღებად, მაგ. `ტაქსონომია-წიგნებში~ ამოღებულია `ტაქსონომია~','Whether a theme uses block-based template parts.'=>'იყენებს თუ არა თემა ბლოკზე დაფუძნებულ შაბლონის ნაწილებს.','Whether the theme disables generated layout styles.'=>'გამორთავს თუ არა თემა გენერირებულ განლაგების სტილებს.','An array of post types that the pattern is restricted to be used with.'=>'პოსტის ტიპების მასივი, რომლებთანაც ნიმუში შეზღუდულია გამოსაყენებლად.','If you are the owner of this network please check that your host&#8217;s database server is running properly and all tables are error free.'=>'თუ თქვენ ხართ ამ ქსელის მფლობელი, გთხოვთ, შეამოწმოთ, რომ თქვენი ჰოსტის მონაცემთა ბაზის სერვერი გამართულად მუშაობს და ყველა ცხრილი შეცდომის გარეშეა.','REST API %1$s should be an array of arrays. Non-array value detected for %2$s.'=>'REST API %1$s უნდა იყოს მასივების მასივი. გამოვლენილია არამასივნის მნიშვნელობა %2$s-ისთვის.','<strong>Conflicting values for the constants %1$s and %2$s.</strong> The value of %2$s will be assumed to be your subdomain configuration setting.'=>'<strong>კონფლიქტური მნიშვნელობები მუდმივებისთვის %1$s და %2$s.</strong> მნიშვნელობა %2$s იქნება თქვენი ქვედომენის კონფიგურაციის პარამეტრი.','*'=>'*','Logged in as %1$s. <a href="%2$s">Edit your profile</a>. <a href="%3$s">Log out?</a>'=>'შესული ხართ როგორც %1$s. <a href="%2$s">თქვენი პროფილის რედაქტირება</a> . <a href="%3$s">გასვლა?</a>','%sX-Large'=>'%sX-Large','%sX-Small'=>'%sX-Small','Cache key must not be an empty string.'=>'ქეშის გასაღები არ უნდა იყოს ცარიელი სტრიქონი.','put your unique phrase here'=>'განათავსეთ თქვენი უნიკალური ფრაზა აქ','There has been a critical error on this website. Please reach out to your site administrator, and inform them of this error for further assistance.'=>'იყო კრიტიკული შეცდომა ამ ვებსაიტზე. გთხოვთ, დაუკავშირდეთ თქვენი საიტის ადმინისტრატორს და აცნობეთ მათ ამ შეცდომის შესახებ დამატებითი დახმარებისთვის.','When checking for the %s capability, you must always check it against a specific comment.'=>'როდესაც ამოწმებთ %s შესაძლებლობებს, ის ყოველთვის უნდა შეამოწმოთ კონკრეტული კომენტარის მიხედვით.','When checking for the %s capability, you must always check it against a specific term.'=>'როდესაც ამოწმებთ %s შესაძლებლობებს, ყოველთვის უნდა შეამოწმოთ იგი კონკრეტულ ტერმინთან.','When checking for the %s capability, you must always check it against a specific user.'=>'%s შესაძლებლობის შემოწმებისას, თქვენ ყოველთვის უნდა შეამოწმოთ იგი კონკრეტული მომხმარებლის წინააღმდეგ.','Your %1$s file uses a dynamic value (%2$s) for the path at %3$s. However, the value at %3$s is also a dynamic value (pointing to %4$s) and pointing to another dynamic value is not supported. Please update %3$s to point directly to %4$s.'=>'თქვენი %1$s ფაილი იყენებს დინამიურ მნიშვნელობას (%2$s) ბილიკისთვის %3$s-ზე. თუმცა, მნიშვნელობა %3$s-ზე ასევე არის დინამიური მნიშვნელობა (მიუთითებს %4$s-ზე) და სხვა დინამიურ მნიშვნელობაზე მითითება არ არის მხარდაჭერილი. გთხოვთ, განაახლოთ %3$s, რათა პირდაპირ მიუთითოთ %4$s-ზე.','Cache key must be an integer or a non-empty string, %s given.'=>'ქეშის გასაღები უნდა იყოს მთელი რიცხვი ან არა ცარიელი სტრიქონი, მოცემული %s.','Deleted author: %s'=>'წაშლილი ავტორი: %s','Not found: %1$s (%2$s)'=>'ვერ მოიძებნა: %1$s (%2$s)','Template for %s'=>'შაბლონი %s-ისთვის','When checking for the %s capability, you must always check it against a specific page.'=>'როდესაც ამოწმებთ %s შესაძლებლობებს, ყოველთვის უნდა შეამოწმოთ იგი კონკრეტულ გვერდზე.','When checking for the %s capability, you must always check it against a specific post.'=>'როდესაც ამოწმებთ %s შესაძლებლობებს, ყოველთვის უნდა შეამოწმოთ იგი კონკრეტულ პოსტზე.','Your object cache implementation does not support flushing individual groups.'=>'თქვენი ობიექტის ქეშის იმპლემენტაცია არ უჭერს მხარს ცალკეული ჯგუფების გაწმენდას.','Your object cache implementation does not support flushing the in-memory runtime cache.'=>'თქვენი ობიექტის ქეშის განხორციელება არ უჭერს მხარს მეხსიერების გაშვების დროის ქეშის გასუფთავებას.','Cron reschedule event error for hook: %1$s, Error code: %2$s, Error message: %3$s, Data: %4$s'=>'Cron-ის ღონისძიების გადაგეგმვის შეცდომა ჰუკისთვის: %1$s, შეცდომის კოდი: %2$s, შეცდომის შეტყობინება: %3$s, მონაცემები: %4$s','Cron unschedule event error for hook: %1$s, Error code: %2$s, Error message: %3$s, Data: %4$s'=>'Cron მოვლენის განრიგის გაუქმების შეცდომა hook-ისთვის: %1$s, შეცდომის კოდი: %2$s, შეცდომის შეტყობინება: %3$s, მონაცემები: %4$s','Block pattern categoryFooters'=>'ქვედა კოლონტიტულები','Whether a theme uses block-based templates.'=>'იყენებს თუ არა თემა ბლოკზე დაფუძნებულ შაბლონებს.','The ID of the page that should be displayed on the front page'=>'გვერდის ID, რომელიც უნდა იყოს ნაჩვენები პირველ გვერდზე','The ID of the page that should display the latest posts'=>'გვერდის ID, რომელიც უნდა აჩვენოს უახლესი პოსტები','What to show on the front page'=>'რა უნდა აჩვენო პირველ გვერდზე','File %1$s is <strong>deprecated</strong> since version %2$s with no alternative available.'=>'ფაილი %1$s <strong>მოძველებულია</strong> ვერსიიდან %2$s და ალტერნატივა არ არის ხელმისაწვდომი.','File %1$s is <strong>deprecated</strong> since version %2$s! Use %3$s instead.'=>'ფაილი %1$s <strong>მოძველებულია</strong> ვერსიიდან %2$s! ამის ნაცვლად გამოიყენეთ %3$s.','Function %1$s is <strong>deprecated</strong> since version %2$s with no alternative available.'=>'ფუნქცია %1$s <strong>მოძველებულია</strong> ვერსიიდან %2$s და ალტერნატივა არ არის ხელმისაწვდომი.','Function %1$s is <strong>deprecated</strong> since version %2$s! Use %3$s instead.'=>'ფუნქცია %1$s <strong>მოძველებულია</strong> ვერსიიდან %2$s! ამის ნაცვლად გამოიყენეთ %3$s.','block titleRead More'=>'გაიგე მეტი','block descriptionContains the block elements used to render content when no query results are found.'=>'შეიცავს ბლოკის ელემენტებს, რომლებიც გამოიყენება შიგთავსის გამოსატანად, როდესაც მოთხოვნის შედეგები არ არის ნაპოვნი.','block descriptionDisplays the link of a post, page, or any other content-type.'=>'ჩანაწერის, გვერდის ან ნებისმიერი სხვა ტიპის შინაარსის ბმულის ჩვენება.','block titleNo results'=>'შედეგების გარეშე','block titleAuthor Biography'=>'ავტორის ბიოგრაფია','block descriptionCreate a link that always points to the homepage of the site. Usually not necessary if there is already a site title link present in the header.'=>'შექმენით ბმული, რომელიც ყოველთვის მიუთითებს საიტის მთავარ გვერდზე. როგორც წესი, არ არის საჭირო, თუ სათაურში უკვე არის საიტის სათაურის ბმული.','block descriptionDisplay post author details such as name, avatar, and bio.'=>'ჩანაწერის ავტორის დეტალების ჩვენება, როგორიცაა სახელი, ავატარი და ბიოგრაფია.','block descriptionThe author biography.'=>'ჩანაწერის ავტორის ბიოგრაფია.','block descriptionAn advanced block that allows displaying post comments using different visual configurations.'=>'გაფართოებული ბლოკი, რომელიც იძლევა ჩანაწერის კომენტარების ჩვენების საშუალებას სხვადასხვა ვიზუალური კონფიგურაციის გამოყენებით.','block titleComments Title'=>'კომენტარების სათაური','block descriptionDisplays a title with the number of comments.'=>'სათაურის ჩვენება კომენტარების რაოდენობით','block descriptionGather blocks in a layout container.'=>'ბლოკების შეგროვება განლაგების კონტეინერში.','block titleHome Link'=>'მთავარი ბმული','block titleComments Pagination'=>'კომენტარები, გვერდებად დაშლილი','block descriptionDisplays a paginated navigation to next/previous set of comments, when applicable.'=>'გვერდებად დაშლილი ნავიგაციის ჩვენება კომენტარების შემდეგი/წინა ნაკრებისკენ, საჭიროების შემთხვევაში.','block descriptionDisplays the previous comment\'s page link.'=>'წინა კომენტარის გვერდის ბმულის ჩვენება.','block titleComment Template'=>'კომენტარის შაბლონი','block descriptionContains the block elements used to display a comment, like the title, date, author, avatar and more.'=>'შეიცავს ბლოკის ელემენტებს, რომლებიც გამოიყენება კომენტარების საჩვენებლად, როგორიცაა სათაური, თარიღი, ავტორი, ავატარი და სხვა.','block descriptionDisplays a link to reply to a comment.'=>'ბმულის ჩვენება კომენტარზე პასუხის გასაცემად.','block descriptionDisplays a list of page numbers for comments pagination.'=>'გვერდის ნომრების სიის ჩვენება კომენტარების გვერდებად დაშლისათვის.','block descriptionDisplays the next comment\'s page link.'=>'შემდეგი კომენტარის გვერდის ბმულის ჩვენება.','block titleComment Edit Link'=>'კომენტარის ჩასწორების ბმული','block titleComment Reply Link'=>'კომენტარის პასუხის ბმული','block descriptionDisplays a link to edit the comment in the WordPress Dashboard. This link is only visible to users with the edit comment capability.'=>'ბმულის ჩვენება კომენტარის რედაქტირებისთვის WordPress Dashboard-ში. ეს ბმული ხილულია მხოლოდ კომენტარების რედაქტირების შესაძლებლობის მქონე მომხმარებლებისთვის.','block descriptionDisplays the contents of a comment.'=>'კომენტარის შიგთავსის ჩვენება.','block descriptionDisplays the date on which the comment was posted.'=>'კომენტარის გამოქვეყნების თარიღის ჩვენება.','block descriptionAdd a user’s avatar.'=>'დაამატეთ მომხმარებლის ავატარი.','block titleAvatar'=>'ავატარი','block titleComment Author Name'=>'კომენტარის ავტორის სახელი','block descriptionDisplays the name of the author of the comment.'=>'კომენტარის ავტორის სახელის ჩვენება.','A WordPress Commenter'=>'კომენტარის ავტორი','Response to %s'=>'პასუხად: %s','Responses to %s'=>'პასუხები %s-ზე','block titleComment Date'=>'კომენტარის თარიღი','block titleComment Content'=>'კომენტარის შიგთავსი','Default Avatar'=>'ნაგულისხმევი ავატარი','There is already a ping from that URL for this post.'=>'უკვე არის ping ამ URL-დან ამ პოსტისთვის.','Need more help? <a href="%1$s">Read the support article on %2$s</a>.'=>'გჭირდებათ მეტი დახმარება? <a href="%1$s">წაიკითხეთ მხარდაჭერის სტატია %2$s-ზე</a> .','The password cannot be a space or all spaces.'=>'პაროლი არ შეიძლება იყოს ინტერვალი ან ყველა სივრცე.','The database server could be connected to (which means your username and password is okay) but the %s database could not be selected.'=>'მონაცემთა ბაზის სერვერი შეიძლება იყოს დაკავშირებული (რაც ნიშნავს, რომ თქვენი მომხმარებლის სახელი და პაროლი ნორმალურია), მაგრამ %s მონაცემთა ბაზის არჩევა ვერ მოხერხდა.','Cannot select database'=>'მონაცემთა ბაზის არჩევა შეუძლებელია','Sorry, the video at the supplied URL cannot be loaded. Please check that the URL is for a supported video file (%s) or stream (e.g. YouTube and Vimeo).'=>'უკაცრავად, ვიდეო მიწოდებულ URL-ზე ვერ იტვირთება. გთხოვთ, შეამოწმოთ, რომ URL არის მხარდაჭერილი ვიდეო ფაილისთვის (%s) ან ნაკადისთვის (მაგ. YouTube და Vimeo).','That file cannot be found. Check your <a href="%s">media library</a> and make sure it was not deleted.'=>'ეს ფაილი ვერ მოიძებნა. შეამოწმეთ თქვენი <a href="%s">მედია ბიბლიოთეკა</a> და დარწმუნდით, რომ ის არ არის წაშლილი.','That image cannot be found. Check your <a href="%s">media library</a> and make sure it was not deleted.'=>'ეს სურათი ვერ მოიძებნა. შეამოწმეთ თქვენი <a href="%s">მედია ბიბლიოთეკა</a> და დარწმუნდით, რომ ის არ არის წაშლილი.','That video cannot be found. Check your <a href="%s">media library</a> and make sure it was not deleted.'=>'ეს ვიდეო ვერ მოიძებნა. შეამოწმეთ თქვენი <a href="%s">მედია ბიბლიოთეკა</a> და დარწმუნდით, რომ ის არ არის წაშლილი.','That audio file cannot be found. Check your <a href="%s">media library</a> and make sure it was not deleted.'=>'ეს აუდიო ფაილი ვერ მოიძებნა. შეამოწმეთ თქვენი <a href="%s">მედია ბიბლიოთეკა</a> და დარწმუნდით, რომ ის არ არის წაშლილი.','Unable to pass %s if not using multisite.'=>'შეუძლებელია %s-ის გავლა, თუ არ იყენებთ მრავალსაიტს.','User URL may not be longer than 100 characters.'=>'მომხმარებლის URL არ შეიძლება იყოს 100 სიმბოლოზე მეტი.','Each webfont src must be a non-empty string.'=>'თითოეული ვებ შრიფტის src უნდა იყოს არა ცარიელი სტრიქონი.','Webfont font family must be a non-empty string.'=>'Webfont შრიფტის ოჯახი უნდა იყოს არა ცარიელი სტრიქონი.','Webfont font weight must be a properly formatted string or integer.'=>'Webfont-ის შრიფტის წონა უნდა იყოს სწორად ფორმატირებული სტრიქონი ან მთელი რიცხვი.','Webfont src must be a non-empty string or an array of strings.'=>'Webfont src უნდა იყოს არა ცარიელი სტრიქონი ან სტრიქონების მასივი.','Ancestor blocks.'=>'წინაპარი ბლოკები.','Determines whether the pattern is visible in inserter.'=>'ადგენს, ჩანს თუ არა ნიმუში ჩასმაში.','Limit results to those matching a pattern (slug).'=>'შეზღუდეთ შედეგები იმით, რომლებიც შეესაბამება შაბლონს (slug).','Block types that the pattern is intended to be used with.'=>'ბლოკის ტიპები, რომლებთანაც განკუთვნილია შაბლონის გამოყენება.','Sorry, you are not allowed to view the registered block pattern categories.'=>'უკაცრავად, თქვენ არ გაქვთ რეგისტრირებული ბლოკის ნიმუშის კატეგორიების ნახვის უფლება.','Sorry, you are not allowed to view the registered block patterns.'=>'უკაცრავად, თქვენ არ გაქვთ რეგისტრირებული ბლოკის შაბლონების ნახვის უფლება.','The category label, in human readable format.'=>'კატეგორიის ეტიკეტი, ადამიანის წასაკითხად ფორმატში.','The category name.'=>'კატეგორიის სახელი.','The pattern category slugs.'=>'ნიმუშის კატეგორიის იარლიყები.','The pattern detailed description.'=>'ნიმუშის დეტალური აღწერა.','The pattern keywords.'=>'ნიმუშის საკვანძო სიტყვები.','The pattern name.'=>'ნიმუშის სახელი.','The pattern viewport width for inserter preview.'=>'შაბლონის ხედის სიგანე ჩამწერის გადახედვისთვის.','Error in deleting the attachment.'=>'შეცდომა დანართის წაშლისას.','unit symbolEB'=>'ებ','unit symbolPB'=>'პბ','unit symbolYB'=>'იობ','<strong>Error:</strong> This is not a valid feed template.'=>'<strong>შეცდომა:</strong> ეს არ არის სწორი არხის შაბლონი.','unit symbolZB'=>'ზბაიტი','The description will be displayed in the menu if the active theme supports it.'=>'აღწერა გამოჩნდება მენიუში, თუ აქტიური თემა მხარს უჭერს მას.','A title on that page cannot be found.'=>'ამ გვერდზე სათაური ვერ მოიძებნა.','color schemeDark'=>'მუქი','color schemeLight'=>'ნათელი','<strong>Error:</strong> The themes directory is either empty or does not exist. Please check your installation.'=>'<strong>შეცდომა:</strong> თემების დირექტორია ან ცარიელია ან არ არსებობს. გთხოვთ, შეამოწმოთ თქვენი ინსტალაცია.','File does not exist?'=>'პლაგინის ფაილი არ არსებობს?','Adding an RSS feed to this site’s homepage is not supported, as it could lead to a loop that slows down your site. Try using another block, like the <strong>Latest Posts</strong> block, to list posts from the site.'=>'RSS არხის დამატება ამ საიტის მთავარ გვერდზე არ არის მხარდაჭერილი, რადგან ამან შეიძლება გამოიწვიოს ციკლი, რომელიც ანელებს თქვენს საიტს. სცადეთ გამოიყენოთ სხვა ბლოკი, როგორიცაა <strong>უახლესი შეტყობინებების</strong> ბლოკი, რათა ჩამოთვალოთ პოსტები საიტიდან.','%s Avatar'=>'%s ავატარი','Response'=>'პასუხი','(%s author archive, opens in a new tab)'=>'(%s ავტორის არქივი, იხსნება ახალ ჩანართში)','(%s website link, opens in a new tab)'=>'(%s ვებსაიტის ბმული, იხსნება ახალ ჩანართში)','Newer Comments'=>'ახალი კომენტარები','Older Comments'=>'ძველი კომენტარები','Responses'=>'პასუხები','Could not register file "%1$s" as a block pattern (invalid slug "%2$s")'=>'ფაილი „%1$s“ ვერ დარეგისტრირდა ბლოკის შაბლონად (არასწორი ჭდე „%2$s“)','Could not register file "%s" as a block pattern ("Slug" field missing)'=>'ფაილის "%s" დარეგისტრირება ვერ მოხერხდა ბლოკის შაბლონად (ველი "Slug" აკლია)','Could not register file "%s" as a block pattern ("Title" field missing)'=>'ფაილი „%s“ ვერ დარეგისტრირდა ბლოკის შაბლონად (ველი „სათაური“ აკლია)','Block pattern categoryFeatured'=>'რჩეული','Hurray! Your theme supports site editing with blocks. <a href="%1$s">Tell me more</a>. %2$s'=>'ვაშა! თქვენი თემა მხარს უჭერს საიტის სრულ რედაქტირებას ბლოკებით. <a href="%1$s">მითხარი მეტი</a> . %2$s','Use Site Editor'=>'საიტის რედაქტორის გამოყენება','Site icon.'=>'საიტის ხატულა.','block descriptionDisplay the description of categories, tags and custom taxonomies when viewing an archive.'=>'არქივის ნახვისას კატეგორიების, ჭდეებისა და მორგებული ტაქსონომიების აღწერილობის ჩვენება.','block descriptionEdit the different global regions of your site, like the header, footer, sidebar, or create your own.'=>'შეცვალეთ თქვენი საიტის სხვადასხვა გლობალური რეგიონები, როგორიცაა სათაური, სარდაფი, გვერდითი ჭიქი ან შექმენით საკუთარი.','block titleTerm Description'=>'ტერმინის აღწერა','block descriptionCreate structured content in rows and columns to display information.'=>'შექმენით სტრუქტურირებული შიგთავსი რიგებად და სვეტებად ინფორმაციის საჩვენებლად.','block titleTemplate Part'=>'შაბლონის ნაწილი','block descriptionDisplays the name of this site. Update the block, and the changes apply everywhere it’s used. This will also appear in the browser title bar and in search results.'=>'აჩვენებს ამ საიტის სახელს. განაახლეთ ბლოკი და ცვლილებები ვრცელდება ყველგან, სადაც ის გამოიყენება. ის ასევე გამოჩნდება ბრაუზერის სათაურის ზოლში და ძიების შედეგებში.','block titleNext Page'=>'შემდეგი გვერდი','block titlePagination'=>'ნავიგაცია','block style labelPlain'=>'მარტივი','block titlePrevious Page'=>'წინა გვერდი','block descriptionDisplay a post\'s comments form.'=>'ჩანაწერის კომენტარის ჩვენება.','block descriptionDisplays the next or previous post link that is adjacent to the current post.'=>'შემდეგი, ან წინა ჩანაწერის ბმულის ჩვენება, რომელიც მიმდინარე ჩანაწერის გვერდით არის განთვსებული.','block titlePage Numbers'=>'გვერდის ნომრები','block titlePost Navigation Link'=>'ჩანაწერის ნავიგაციის ბმული','block titlePattern'=>'თარგი','block titleComments Form'=>'ჩანაწერის კომენტარები','block titleSubmenu'=>'ქვემენიუ','block descriptionA collection of blocks that allow visitors to get around your site.'=>'ბლოკების კოლექცია, რომელიც საშუალებას აძლევს სტუმრებს გადაადგილდნენ თქვენს საიტზე.','block descriptionAdd a page, link, or another item to your navigation.'=>'დაამატეთ გვერდი, ბმული ან სხვა ელემენტი თქვენს ნავიგაციაში.','block descriptionAdd a submenu to your navigation.'=>'დაამატეთ ქვემენიუ თქვენს ნავიგაციაში.','block titleCustom Link'=>'მორგებული ბმული','block titleNavigation'=>'ნავიგაცია','block descriptionShow a block pattern.'=>'ბლოკის ნიმუშის ჩვენება.','block descriptionDisplay content in multiple columns, with blocks added to each column.'=>'შიგთავსის ჩვენება მრავალ სვეტში, თითოეულ სვეტში ბლოკის დამატებით.','No comments'=>'კომენტარები ჯერ არ არის','Confirm'=>'დადასტურება','Could not retrieve table charset.'=>'ცხრილის კოდირების მიღება ვერ მოხერხდა.','Could not strip invalid text.'=>'ვერ მოხერხდა არასწორი ტექსტის წაშლა.','WordPress database error: Processing the values for the following fields failed: %s. The supplied values may be too long or contain invalid data.'=>'WordPress მონაცემთა ბაზის შეცდომა: შემდეგი ველების მნიშვნელობების დამუშავება ვერ მოხერხდა: %s. მიწოდებული მნიშვნელობები შეიძლება ძალიან გრძელი იყოს ან შეიცავდეს არასწორ მონაცემებს.','WordPress database error: Could not perform query because it contains invalid data.'=>'WordPress მონაცემთა ბაზის შეცდომა: შეკითხვის შესრულება ვერ ხერხდება, რადგან ის შეიცავს არასწორ მონაცემებს.','WordPress database error: Processing the value for the following field failed: %s. The supplied value may be too long or contains invalid data.'=>'WordPress მონაცემთა ბაზის შეცდომა: შემდეგი ველის მნიშვნელობის დამუშავება ვერ მოხერხდა: %s. მიწოდებული მნიშვნელობა შეიძლება ძალიან გრძელი იყოს ან შეიცავს არასწორ მონაცემებს.','Assign a parent term to create a hierarchy. The term Jazz, for example, would be the parent of Bebop and Big Band.'=>'დანიშნეთ მშობელი ელემენტი იერარქიის შესაქმნელად. მაგალითად, „ჯაზი“ შეიძლება გახდეს „ბიბოპის“, ან „ბიგ-ბენდის“ მშობელი.','"%1$s" script should not be enqueued together with the new widgets editor (%2$s or %3$s).'=>'“%1$s” სკრიპტი არ უნდა იყოს რიგით ახალი ვიჯეტების რედაქტორთან (%2$s ან %3$s).','"%1$s" style should not be enqueued together with the new widgets editor (%2$s or %3$s).'=>'“%1$s” სტილი არ უნდა იყოს რიგით ახალ ვიჯეტის რედაქტორთან (%2$s ან %3$s).','The description is not prominent by default; however, some themes may show it.'=>'აღწერილობა ნაგულისხმევად არ არის ცნობილი; თუმცა, ზოგიერთმა თემამ შეიძლება აჩვენოს ეს.','The &#8220;slug&#8221; is the URL-friendly version of the name. It is usually all lowercase and contains only letters, numbers, and hyphens.'=>'&#8220;slug&#8221; არის სახელის URL მეგობრული ვერსია. ჩვეულებრივ, ის არის მოკლე და შეიცავს მხოლოდ ასოებს, ციფრებს და დეფისებს.','The name is how it appears on your site.'=>'სახელი, თუ როგორ გამოჩნდება თქვენს საიტზე.','Template Part Area'=>'შაბლონის ნაწილი არეალი','Template Part Areas'=>'შაბლონის ნაწილების არეები','The server cannot process the image. This can happen if the server is busy or does not have enough resources to complete the task. Uploading a smaller image may help. Suggested maximum size is 2560 pixels.'=>'სერვერს არ შეუძლია სურათის დამუშავება. ეს შეიძლება მოხდეს, თუ სერვერი დაკავებულია ან არ აქვს საკმარისი რესურსი დავალების შესასრულებლად. შეიძლება დაგვეხმაროს პატარა სურათის ატვირთვა. შემოთავაზებული მაქსიმალური ზომაა 2560 პიქსელი.','Limit result set to users matching at least one specific capability provided. Accepts csv list or single capability.'=>'დაწესებული შედეგების შეზღუდვა მომხმარებლებზე, რომლებიც ემთხვევა მინიმუმ ერთ კონკრეტულ შესაძლებლობებს. იღებს csv სიას ან ერთ შესაძლებლობას.','Limit result set to users who have published posts.'=>'შედეგების შეზღუდვა იმ მომხმარებლებისთვის, რომლებმაც გამოაქვეყნეს ჩანაწერები.','Invalid URL'=>'არასწორი URL-მისამართი','Sorry, you are not allowed to filter users by capability.'=>'უკაცრავად, თქვენ არ გაქვთ უფლება გაფილტროთ მომხმარებლები შესაძლებლობით.','Sorry, you are not allowed to process remote URLs.'=>'უკაცრავად, თქვენ არ გაქვთ უფლება დაამუშავოთ დისტანციური url-ები.','The content of the %s element from the URL.'=>'%s ელემენტის შინაარსი URL-დან.','The contents of the %s element from the URL.'=>'%s ელემენტის შინაარსი URL-დან.','The favicon image link of the %s element from the URL.'=>'URL-ს %s ელემენტის ფევიკონის გამოსახულების ბმული.','The Open Graph image link of the %1$s or %2$s element from the URL.'=>'%1$s ან %2$s Open Graph-ის გამოსახულების ბმული URL-დან.','The URL to process.'=>'URL დამუშავება.','Unable to retrieve body from response at this URL.'=>'ამ URL-ზე შეუძლებელია პასუხსი ტექსტის მიღება.','URL not found. Response returned a non-200 status code for this URL.'=>'URL ვერ მოიძებნა. პასუხმა დაუბრუნა არა-200 სტატუსის კოდი ამ URL-სთვის.','Content for the template, as it exists in the database.'=>'შიგთავსი შაბლონისთვის, როგორც ის არსებობს მონაცემთა ბაზაში.','HTML title for the template, transformed for display.'=>'HTML-სათაური შაბლონისათვის, რომელიც გარდაქმნილია ჩვენებისათვის.','Limit to the specified template part area.'=>'შაბლონის ნაწილის მითითებული არეალის შეზღუდვა.','Post type to get the templates for.'=>'ჩანაწერის ტიპი, რომლისთვისაც უნდა მიიღოთ შაბლონები.','REST namespace route for the taxonomy.'=>'REST სახელთა სივრცის სვლაგეზი ტაქსონომიისათვის.','Source of a customized template'=>'მორგებული შაბლონების წყარო','The ID for the author of the template.'=>'ID შაბლონების ავტორისთვის.','Title for the template, as it exists in the database.'=>'შაბლონისთვის სათაური, როგორც ეს არსებობს მონაცემთა ბაზაში.','Type of template.'=>'შაბლონის ტიპი.','Version of the content block format used by the template.'=>'შინაარსის ბლოკის ფორმატის ვერსია, რომელსაც იყენებენ შაბლონით.','Where the template part is intended for use (header, footer, etc.)'=>'სადაც შაბლონების ნაწილი განკუთვნილია გამოყენებისათვის (ზედა კოლონტიტული, ქვედა კოლონტიტული და ა.შ.)','Whether a template is a custom template.'=>'არის თუ არა შაბლონი მორგებული შაბლონი.','Whether to make the post type available for selection in navigation menus.'=>'ჩანაწერის ტიპის გაკეთება ხელმისაწვდომია სანავიგაციო მენიუებში შერჩევისთვის.','The terms assigned to the object in the %s taxonomy.'=>'ელემენტი მიენიჭა ობიექტს %s ტაქსონომიაში.','An alphanumeric identifier for the menu location.'=>'ანბანური იდენტიფიკატორი მენიუს მდებარეობისთვის.','Invalid menu location.'=>'მენიუს არასწორი მდებარეობა.','Menus do not support trashing. Set \'%s\' to delete.'=>'მენიუ არ უჭერს მხარს სანაგვეში გადატანას. დააყენეთ “%s” წაშლაზე.','REST route\'s namespace for the post type.'=>'REST სახელთა სივრცის სვლაგეზი ჩანაწერის ტიპისათვის.','Sorry, you are not allowed to view menu locations.'=>'უკაცრავად, თქვენ არ გაქვთ უფლება ნახოთ მენიუს ადგილმდებარეობა.','Sorry, you are not allowed to view menus.'=>'უკაცრავად, თქვენ არ გაქვთ უფლება ნახოთ მენიუები.','The description of the menu location.'=>'მენიუს ადგილმდებარეობის აღწერა.','The ID of the assigned menu.'=>'მინიჭებული მენიუს ID.','The locations assigned to the menu.'=>'მენიუზე მინიჭებული ადგილები.','The menu cannot be deleted.'=>'მენიუ არ შეიძლება წაიშალოს.','The name of the menu location.'=>'მენიუს ადგილმდებარეობის სახელი.','The visibility settings for the post type.'=>'ჩანაწერის ტიპის ხილვადობის პარამეტრები.','Whether to automatically add top level pages to this menu.'=>'ავტომატურად დაამატოთ ზედა დონის გვერდები ამ მენიუში.','Whether to generate a default UI for managing this post type.'=>'ამ ჩანაწერის ტიპის მართვისთვის ნაგულისხმევი UI გენერირება.','The database ID of the original object this menu item represents, for example the ID for posts or the term_id for categories.'=>'ამ მენიუს ელემენტის ორიგინალური ობიექტის მონაცემთა ბაზის ID წარმოადგენს, მაგალითად, ID-ს ჩანაწერებისათვის ან term_id-ს კატეგორიებისთვის.','The singular label used to describe this type of menu item.'=>'მხოლობითი იარლიყი გამოიყენება ამ ტიპის მენიუს ელემენტის აღსაწერად.','The target attribute of the link element for this menu item.'=>'ბმულის ელემენტის სამიზნე ატრიბუტი ამ მენიუს ელემენტისთვის.','The type of object originally represented, such as "category", "post", or "attachment".'=>'თავდაპირველად წარმოდგენილი ობიექტის ტიპი წარმოდგენილია, როგორიცაა “category”, “post”, or “attachment”.','The URL to which this menu item points.'=>'URL, რომელზეც ეს მენიუ მიუთითებს.','The XFN relationship expressed in the link of this menu item.'=>'XFN ურთიერთობა გამოხატულია ამ მენიუს ელემენტის ბმულზე.','Whether the menu item represents an object that no longer exists.'=>'წარმოადგენს თუ არა მენიუს ელემენტი იმ ობიექტს, რომელიც აღარ არსებობს.','The ID for the parent of the object.'=>'ობიექტის მშობელის ID.','A named status for the object.'=>'ობიექტის დასათაურებული სტატუსი.','Class names for the link element of this menu item.'=>'ელემენტის link კლასების სახელი, მენიუს ამ პუნქტისათვის.','Text for the title attribute of the link element for this menu item.'=>'ტექსტი ბმულის ელემენტის სათაურის ატრიბუტისთვის ამ მენიუს ელემენტისთვის.','The DB ID of the nav_menu_item that is this item\'s menu parent, if any, otherwise 0.'=>'nav_menu_item DB ID, რომელიც ამ ელემენტის მენიუს მშობელია, ასეთის არსებობის შემთხვევაში, სხვაგვარად 0.','The description of this menu item.'=>'ამ მენიუს ელემენტის აღწერა.','The family of objects originally represented, such as "post_type" or "taxonomy".'=>'თავდაპირველად წარმოდგენილი ობიექტების წარმოდგენილი იყო, როგორიცაა "post_type" ან “taxonomy”.','HTML title for the object, transformed for display.'=>'HTML სათაური ობიექტისათვის, გარდაქმნილი საჩვენებლად.','Title for the object, as it exists in the database.'=>'ობიექტისა სახელი, როგორც ის არსებობს მონაცემთა ბაზაში.','Get linked object.'=>'დაკავშირებული ობიექტის მიღება.','Menu items do not support trashing. Set \'%s\' to delete.'=>'მენიუს ელემენტები არ უჭერს მხარს სანაგვეში გადატანას. დააყენეთ "%s" წაშლაზე.','Sorry, you are not allowed to access the global styles on this site.'=>'უკაცრავად, თქვენ არ გაქვთ უფლება მიიღოთ გლობალური სტილები ამ საიტზე.','The title is required when using a custom menu item type.'=>'სათაური საჭიროა მენიუს ელემენტის ტიპის გამოყენებისას.','The url is required when using a custom menu item type.'=>'url საჭიროა მორგებული მენიუს ელემენტის ტიპის გამოყენებისას.','Global settings.'=>'გლობალური პარამეტრები.','Global styles.'=>'გლობალური სტილები.','ID of global styles config.'=>'გლობალური სტილის კონფიგურაციის ID.','No global styles config exist with that id.'=>'გლობალური სტილის კონფიგურაცია არ არსებობს ამ იდენტიფიკატორით.','Public facing and editor script handles.'=>'სკრიპტის ღია წვდომისა და ჩასწორების დესკრიპტორი.','Public facing and editor style handles.'=>'სტილის ღია წვდომისა და ჩასწორების დესკრიპტორი.','Sorry, you are not allowed to edit this global style.'=>'უკაცრავად, თქვენ არ გაქვთ უფლება შეცვალოთ ეს გლობალური სტილი.','Sorry, you are not allowed to export templates and template parts.'=>'უკაცრავად, თქვენ არ გაქვთ უფლება მოახდინოთ შაბლონებისა და შაბლონის ნაწილების ექსპორტი.','Sorry, you are not allowed to view this global style.'=>'უკაცრავად, თქვენ არ გაქვთ უფლება ნახოთ ეს გლობალური სტილი.','The date when the block was last updated.'=>'თარიღი, როდესაც ბლოკი ბოლოს განახლდა.','The theme identifier'=>'თემის იდენტიფიკატორი','Title for the global styles variation, as it exists in the database.'=>'გლობალური სტილის ვარიაციის სათაური, რადგან ის არსებობს მონაცემთა ბაზაში.','Title of the global styles variation.'=>'გლობალური სტილის ცვალებადობის სათაური.','file type groupAudio'=>'აუდიო','file type groupVideo'=>'ვიდეო','Add New Navigation Menu'=>'ახალი ნავიგაციის მენიუს დამატება','Edit Navigation Menu'=>'ნავიგაციის მენიუს ჩასწორება','Filter Navigation Menu list'=>'სანავიგაციო მენიუს სიის ფილტრი','Insert into Navigation Menu'=>'სანავიგაციო მენიუში ჩასმა','Navigation Menu archives'=>'სანავიგაციო მენიუს არქივები','Navigation Menus list'=>'სანავიგაციო მენიუების სია','Navigation Menus list navigation'=>'სანავიგაციო მენიუების სიის ნავიგაცია','Navigation menus that can be inserted into your site.'=>'სანავიგაციო მენიუები, 