tch requests.'=>'მოთხოვნილი მარშრუტი მხარს არ უჭერს ჯგუფურ მოთხოვნებს.','This password reset request originated from the IP address %s.'=>'პაროლის გადაყენების ეს მოთხოვნა წარმოიშვა IP მისამართიდან %s.','Version of block API.'=>'ბლოკის API ვერსია.','You need to pass an array of post formats.'=>'თქვენ უნდა გაიაროთ მასალის ფორმატის მასივი.','Sorry, you are not allowed to comment on this post.'=>'უკაცრავად, არ გაქვთ ამ ჩანაწერზე კომენტარის დამატების უფლება.','The %s constant is no longer supported.'=>'%s მუდმივა აღარ არის მხარდაჭერილი.','There is a new version of %s available, but it does not work with your version of PHP.'=>'ხელმისაწვდომია %s-ის ახალი ვერსია, მაგრამ ის არ მუშაობს თქვენს PHP ვერსიასთან.','There is a new version of %s available, but it does not work with your version of WordPress.'=>'ხელმისაწვდომია %s-ის ახალი ვერსია, მაგრამ ის არ მუშაობს თქვენს WordPress ვერსიასთან.','There is a new version of %s available, but it does not work with your versions of WordPress and PHP.'=>'ხელმისაწვდომია %s-ის ახალი ვერსია, მაგრამ ის არ მუშაობს თქვენს WordPress და PHP ვერსიებთან.','<a href="%1$s">Please update WordPress</a>, and then <a href="%2$s">learn more about updating PHP</a>.'=>'<a href="%1$s">გთხოვთ განაახლოთ WordPress</a>, შემდეგ <a href="%2$s">გაიგეთ მეტი PHP-ის განახლების შესახებ</a>.','<a href="%s">Learn more about updating PHP</a>.'=>'<a href="%s">შეიტყვეთ მეტი PHP- ის განახლების შესახებ</a> .','<a href="%s">Please update WordPress</a>.'=>'<a href="%s">გთხოვთ განაახლოთ WordPress</a> .','This theme does not work with your version of PHP.'=>'ეს თემა არ მუშაობს თქვენს PHP ვერსიასთან.','This theme does not work with your version of WordPress.'=>'ეს თემა არ მუშაობს WordPress- ის თქვენს ვერსიასთან.','This theme does not work with your versions of WordPress and PHP.'=>'ეს თემა არ მუშაობს WordPress- სა და PHP- ს თქვენს ვერსიებთან.','Please use %s to add new schema properties.'=>'გთხოვთ, გამოიყენოთ %s სქემის ახალი მახასიათებლების დასამატებლად.','The "%s" must be a callable function.'=>'"%s" უნდა იყოს მოსაწვევი ფუნქცია.','Unauthorized. You may remove the %s param to preview as frontend.'=>'უნებართვო. თქვენ შეგიძლიათ წაშალოთ %s პარამეტრი, რომ გადახედოთ წინა მხარეს.','The "%1$s" option key has been renamed to "%2$s".'=>'პარამეტრის ღილაკს "%1$s" გადაარქვეს და გახდა "%2$s".','Sorry, you are not allowed to manage network plugins.'=>'უკაცრავად, თქვენ არ გაქვთ ქსელის პლაგინების მართვის უფლება.','The REST API route definition for %1$s is missing the required %2$s argument. For REST API routes that are intended to be public, use %3$s as the permission callback.'=>'%1$s REST API მარშრუტის განმარტებას აკლია საჭირო %2$s არგუმენტი. REST API მარშრუტებისთვის, რომლებიც გამიზნულია საჯარო, გამოიყენეთ %3$s როგორც ნებართვის გამოძახება.','by %s'=>'ავტორი: %s','Sorry, you are not allowed to activate this plugin.'=>'უკაცრავად, ამ პლაგინის აქტივაციის უფლება არ გაქვთ.','Could not update attachment in the database.'=>'ვერ ხერხდება ბაზაში ჩანაწერის განახლება.','Comment'=>'კომენტარი','Menu Item'=>'მენიუს ელემენტი','Crop'=>'ჩამოჭრა','Embed Handler'=>'დამმუშავებელი ჩაშენება','Read the <a href="%s" target="_blank">Debugging a WordPress Network</a> article. Some of the suggestions there may help you figure out what went wrong.'=>'წაიკითხეთ სტატიის <a href="%s" target="_blank">წაშლა და WordPress ქსელის შესახებ.</a> ზოგიერთი შემოთავაზება შეიძლება დაგეხმაროთ იმის გარკვევაში, თუ რა მოხდა არასწორად.','The file URL has been copied to your clipboard'=>'ფაილის URL კოპირებულია თქვენს ბუფერში','unit symbolB'=>'B','Block pattern categoryColumns'=>'სვეტები','Block pattern categoryGallery'=>'გალერეა','Block pattern categoryText'=>'ტექსტი','Block pattern categoryButtons'=>'ღილაკები','unit symbolGB'=>'გბაიტი','Block pattern categoryHeaders'=>'ჰედერები','unit symbolKB'=>'კბაიტი','unit symbolMB'=>'მბაიტი','unit symbolTB'=>'ტბაიტი','Block pattern category "%s" not found.'=>'დაბლოკვის შაბლონების კატეგორია "%s" ვერ მოიძებნა.','Block pattern category name must be a string