ლი ფორმატით.','Limits results to plugins with the given status.'=>'ზღუდავს შედეგებს მოცემული სტატუსის მქონე დანამატებზე.','Sorry, you are not allowed to browse the block directory.'=>'უკაცრავად, თქვენ არ გაქვთ უფლება დაათვალიეროთ ბლოკის დირექტორია.','The average rating of blocks published by the same author.'=>'იგივე ავტორის მიერ გამოქვეყნებული ბლოკების საშუალო რეიტინგი.','The block name, in namespace/block-name format.'=>'ბლოკის სახელი, namespace / block-name ფორმატში.','The block slug.'=>'ბლოკის იარლიყი.','The block title, in human readable format.'=>'ბლოკის სათაური, ადამიანის მიერ წაკითხვადი ფორმატით.','The number of blocks published by the same author.'=>'იმავე ავტორის მიერ გამოქვეყნებული ბლოკების რაოდენობა.','The number of ratings.'=>'რეიტინგების რაოდენობა.','The number sites that have activated this block.'=>'საიტების რაოდენობა, რომლებმაც გააქტიურეს ეს ბლოკი.','The plugin\'s text domain.'=>'პლაგინის ტექსტური დომენი.','The star rating of the block.'=>'ბლოკის ვარსკვლავების რეიტინგი.','The WordPress.org username of the block author.'=>'ბლოკის ავტორის WordPress.org მომხმარებლის სახელი.','This username is invalid because it uses illegal characters. Please enter a valid username.'=>'მომხმარებლის ეს სახელი არაკორექტულია, ვინაიდან შეიცავს დაუშვებელ სიმბოლოებს. გთხოვთ, გამოიყენეთ კორექტული სახელი.','Sorry, you are not allowed to deactivate this plugin.'=>'უკაცრავად, ამ პლაგინის დეაქტივაციის უფლება არ გაქვთ.','Sorry, you are not allowed to delete plugins for this site.'=>'უკაცრავად, არ გაქვთ ამ საიტზე პლაგინების წაშლის უფლება.','Sorry, you are not allowed to install plugins on this site.'=>'უკაცრავად, არ გაქვთ ამ საიტზე პლაგინების დაყენების უფლება.','Sorry, you are not allowed to manage plugins for this site.'=>'უკაცრავად, არ გაქვთ ამ საიტის პლაგინების მართვის უფლება.','Unable to connect to the filesystem. Please confirm your credentials.'=>'შეუძლებელია ფაილურ სისტემასთან დაკავშირება. გადაამოწმეთ კოორდინატები.','Cannot delete an active plugin. Please deactivate it first.'=>'აქტიური მოდულის წაშლა შეუძლებელია. გთხოვთ, ჯერ გამორთოთ იგი.','Minimum required version of PHP.'=>'PHP მინიმალური საჭირო ვერსია.','Minimum required version of WordPress.'=>'WordPress– ის მინიმალური საჭირო ვერსია.','Network only plugin must be network activated.'=>'მხოლოდ ქსელის პლაგინი უნდა იყოს გააქტიურებული.','Plugin author\'s website address.'=>'პლაგინის ავტორის ვებსაიტის მისამართი.','Plugin not found.'=>'პლაგინი ვერ მოიძებნა.','Sorry, you are not allowed to activate plugins.'=>'უკაცრავად, არ გაქვთ ამ საიტზე პლაგინების გააქტიურების უფლება.','The filesystem is currently unavailable for managing plugins.'=>'ფაილთა სისტემა ამჟამად მიუწვდომელია დანამატების მართვისთვის.','The plugin activation status.'=>'მოდულის აქტივაციის სტატუსი.','The plugin author.'=>'პლაგინის ავტორი.','The plugin description formatted for display.'=>'პლაგინის აღწერა ფორმატირებულია ჩვენებისთვის.','The plugin description.'=>'პლაგინის აღწერა.','The plugin file.'=>'პლაგინის ფაილი.','The plugin name.'=>'პლაგინის სახელი.','The plugin version number.'=>'პლაგინის ვერსიის ნომერი.','The plugin\'s website address.'=>'პლაგინის ვებსაიტის მისამართი.','The raw plugin description.'=>'პლაგინის აღწერა.','Unable to determine what plugin was installed.'=>'შეუძლებელია იმის დადგენა, თუ რომელი პლაგინი დამონტაჟდა.','Whether the plugin can only be activated network-wide.'=>'შესაძლებელია თუ არა პლაგინის გააქტიურება მხოლოდ ქსელის მასშტაბით.','WordPress.org plugin directory slug.'=>'პლაგინის იარლიყი WordPress.org-ის დირექტორიაში.','A description of the theme.'=>'თემის აღწერა.','HTML for the theme author, transformed for display.'=>'HTML თემის ავტორისთვის, გარდაქმნილია საჩვენებლად.','Tags indicating styles and features of the theme.'=>'წარწერები, რომლებიც მიუთითებს თემის სტილებსა და მახასიათებლებს.','The minimum PHP version required for the theme to work.'=>'მინიმალური PHP ვერსია, რომელიც საჭიროა თემის მუშაობისთვის.','The minimum WordPress version required for the theme to work.'=>'WordPress– ის მინიმალური ვერსია, რომელიც საჭიროა თემის მუშაობისთვის.','The name of the theme.'=>'თემის სახელი.','The theme author\'s name, as found in the theme header.'=>'თემის ავტორის სახელი, როგორც ნაპოვნია თემის სათაურში.','The theme author.'=>'თემის ავტორი.','The theme description, as found in the theme header.'=>'თემის აღწერა, როგორც ნაპოვნია თემის სათაურში.','The theme description, transformed for display.'=>'თემის აღწერა გადაკეთდა საჩვენებლად.','The theme name, as found in the theme header.'=>'თემის სახელი, როგორც ნაპოვნია თემის სათაურში.','The theme name, transformed for display.'=>'თემის სახელი გადაკეთდა საჩვენებლად.','The theme tags, as found in the theme header.'=>'თემის ჭდეები, როგორც ნაპოვნია თემის სათაურში.','The theme tags, transformed for display.'=>'თემის ჭდეები გარდაიქმნება საჩვენებლად.','The theme\'s current version.'=>'თემის ამჟამინდელი ვერსია.','The theme\'s screenshot URL.'=>'თემის ეკრანული სურათის URL.','The theme\'s template. If this is a child theme, this refers to the parent theme, otherwise this is the same as the theme\'s stylesheet.'=>'თემის შაბლონი. თუ ეს შვილობილი თემაა, ეს ეხება მშობლის თემას, წინააღმდეგ შემთხვევაში ეს იგივეა, რაც თემის სტილი.','The theme\'s text domain.'=>'თემის ტექსტის დომენი.','The URI of the theme\'s webpage, as found in the theme header.'=>'თემის ვებგვერდის URI, როგორც ნაპოვნია თემის სათაურში.','The URI of the theme\'s webpage, transformed for display.'=>'თემის ვებგვერდის URI გადაკეთდა საჩვენებლად.','The URI of the theme\'s webpage.'=>'თემის ვებგვერდის URI.','The website of the theme author, as found in the theme header.'=>'თემის ავტორის ვებსაიტი, როგორც ეს ნაპოვნია თემის სათაურში.','The website of the theme author, transformed for display.'=>'თემის ავტორის ვებგვერდი გადაკეთდა საჩვენებლად.','The website of the theme author.'=>'თემის ავტორის ვებ-გვერდი.','A list of the inner block\'s own inner blocks. This is a recursive definition following the parent innerBlocks schema.'=>'შიდა ბლოკის საკუთარი შიდა ბლოკების ჩამონათვალი. ეს არის რეკურსიული განმარტება მშობლის შიდა ბლოკირების სქემის შემდეგ.','Block example.'=>'ბლოკის მაგალითი.','Block keywords.'=>'დაბლოკეთ საკვანძო სიტყვები.','Block namespace.'=>'სახელების სივრცის დაბლოკვა.','Contains the handle that defines the block style.'=>'შეიცავს სახელურს, რომელიც განსაზღვრავს ბლოკის სტილს.','Inline CSS code that registers the CSS class required for the style.'=>'Inline CSS კოდი, რომელიც არეგულირებს CSS კლასს, რომელიც საჭიროა სტილისთვის.','Parent blocks.'=>'მშობელი ბლოკები.','Public text domain.'=>'საჯარო ტექსტის დომენი.','The attributes of the inner block.'=>'შიდა ბლოკის ატრიბუტები.','The attributes used in the example.'=>'მაგალითში გამოყენებული ატრიბუტები.','The human-readable label for the style.'=>'ადამიანის მიერ იკითხება იარლიყი სტილისთვის.','The list of inner blocks used in the example.'=>'მაგალითში გამოყენებული შიდა ბლოკების სია.','The name of the inner block.'=>'შიდა ბლოკის სახელი.','The theme\'s stylesheet. This uniquely identifies the theme.'=>'თემის სტილი. ეს ცალსახად განსაზღვრავს თემას.','Unique name identifying the style.'=>'უნიკალური სახელი, რომელიც განსაზღვრავს სტილს.','Block attributes.'=>'ატრიბუტების დაბლოკვა.','Block category.'=>'ბლოკის კატეგორია.','Block name.'=>'ბლოკის სახელი.','Block style variations.'=>'ბლოკის სტილის ვარიაციები.','Block supports.'=>'ბლოკის მხარდაჭერა.','Context provided by blocks of this type.'=>'კონტექსტი მოცემულია ამ ტიპის ბლოკების მიერ.','Context values inherited by blocks of this type.'=>'ამ ტიპის ბლოკებით მემკვიდრეობით მიღებული კონტექსტის მნიშვნელობები.','Description of block type.'=>'ბლოკის ტიპის აღწერა.','Editor script handles.'=>'რედაქტორის სკრიპტის სახელური.','Editor style handles.'=>'რედაქტორის სტილის სახელური.','Icon of block type.'=>'ბლოკის ტიპის ხატულა.','Invalid block type.'=>'არასწორი ბლოკის ტიპი.','Is the block dynamically rendered.'=>'დინამიურად არის ნაჩვენები ბლოკი.','Public facing script handles.'=>'სკრიპტის მართვის საჯაროდ ხელმისწვდომი ელემენტი.','Public facing style handles.'=>'სტილის საჯაროდ ხელმისწვდომი ელემენტი