###DETAILS###'=>'სალამი!

დაწყებული 5.2 ვერსიიდან, WordPress-ს შეუძლია აღმოაჩინოს არსებული შეცდომები პლაგინებში და თემებში საიტზე და გამოგუგზავნოთ თქვენ დეტალური შეტყობინება.
###CAUSE###
ჯერ შედით თქვენს საიტზე (###SITEURL###) და შეამოწმეთ ხილული პრობლემები. შემდეგ გადადით გვერდზე, სადაც გაჩნდა შეცდომა (###PAGEURL###) და ნახეთ ხილული პრობლემები იქ.

###SUPPORT###

თუ თქვენი საიტი გატეხილია და არ შეგიძლიათ კონსოლში შესვლა, ამიერიდან შესაძლებელია სპეციალური „აღდგენის რეჟიმის“ გამოყენება, რომელიც საშუალებას მოგცემთ უსაფრთხოდ შეხვიდეთ საიტზე შემდგომი ნაბიჯებისათვის.

###LINK###

