რდება.','Sorry, you are not allowed to take over.'=>'უკაცრავად, თქვენ არ გაქვთ აღების უფლება.','menu locationsHere&#8217;s where this menu appears. If you would like to change that, pick another location.'=>'ეს არის ადგილი, სადაც გამოჩნდება მენიუ. თუ გსურთ ამის ცვლილება, აირჩიეთ სხვა მდებარეობა.','menu locationsWhere do you want this menu to appear?'=>'სად გსურთ ეს მენიუ გამოჩნდეს?','menu locations(If you plan to use a menu <a href="%1$s" %2$s>widget%3$s</a>, skip this step.)'=>'(თუ თქვენ აპირებთ გამოიყენოთ მენიუ <a href="%1$s" %2$s>ვიჯეტი %3$s</a>, გამოტოვეთ ეს ნაბიჯი.)','You&#8217;ll create a menu, assign it a location, and add menu items like links to pages and categories. If your theme has multiple menu areas, you might need to create more than one.'=>'თქვენ შემქნით მენიუს, მიუთითებთ ადგილს მისთვის, დამატებთ ელემენტებს, როგორიცაა ბმულები გვერდებზე და კატეგორიებზე. თუ თქვენი თემა მხარს უჭერს მენიუს რამდენიმე არეს, საჭირო იქნება ერთზე მეტი მენიუს შექმნა.','It does not look like your site has any menus yet. Want to build one? Click the button to start.'=>'როგორც ჩანს, თქვენს საიტზე ჯერ არ არის არანაირი მენიუ. გსურთ მისი შექმნა? დაწყებისათვის, დააჭირეთ ღილაკზე.','menu locationsView All Locations'=>'ყველა მდებარეობის ნახვა','While previewing a new theme, you can continue to tailor things like widgets and menus, and explore theme-specific options.'=>'ახალი თემის წინასწარი დათვალიერების გარდა, თქვენ შეგიძლიათ განაგრძოთ ისეთი საკითხების მორგება, როგორიცაა ვიჯეტები, ან მენიუ, ასევე გამოიკვლიოთ თემის სპეციფიური პარამეტრები.','Looking for a theme? You can search or browse the WordPress.org theme directory, install and preview themes, then activate them right here.'=>'ეძებთ თემას? თქვენ შეგიძლიათ დაათვალიეროთ WordPress.org-ის თემების დირექტორია, დააყენოთ და დაათვალიეროთ თემები, ხოლო შემდგომ გააქტიუროთ პირდაპირ აქედან.','menu locationsView Location'=>'მდებარეობის ნახვა','No themes found. Try a different search.'=>'ვერცერთი თემა ვერ მოიძებნა. სცადეთ სხვა მოთხოვნა.','Your