###SITEURL###','No images selected'=>'სურათები არჩეული არ არის','Displays an image gallery.'=>'აჩვენებს სურათების გალერეას.','Custom HTML Widget'=>'მორგებული HTML ვიჯეტი','Use the Custom HTML widget to add arbitrary HTML code to your widget areas.'=>'გამოიყენეთ მორგებული HTML ვიჯეტი HTML კოდის დასამატებლად ვიჯეტების არეში.','<strong>Error:</strong> The email address is already used.'=>'<strong>შეცდომა</strong>: ელფოსტის მისამართი უკვე გამოიყენება.','&larr; Go to Categories'=>'&larr; უკან, კატეგორიებში','&larr; Go to Link Categories'=>'&larr; უკან, ბმულების კატეგორიებში','Schedule your customization changes to publish ("go live") at a future date.'=>'დაგეგმეთ თქვენი ცვლილებები სამომავლო თარიღით.','Homepage and posts page must be different.'=>'მთავარი გვერდი და ჩანაწერების გვერდი სხვადასხვა უნდა იყოს.','Sorry, you cannot preview new themes when you have changes scheduled or saved as a draft. Please publish your changes, or wait until they publish to preview new themes.'=>'უკაცრავად, თქვენ არ შეგიძლიათ ახალი თემების წინასწარი დათვალიერება, სანამ გაქვთ დაგეგმილი, ან მონახაზად შენახული ცვლილებები. გამოაქვეყნეთ თქვენი ცვლილებები, ან დაელოდეთ მათ გამოქვეყნებას.','There is %d error which must be fixed before you can save.'=>'წარმოიშვა შეცდომა %d, რომელიც უნდა გასწორდეს მანამდე, სანამ შეინახავთ.','Discard changes'=>'ცვლილებების გაუქმება','Updating'=>'განახლება','Yiddish'=>'იდიში','Welsh'=>'უელსური','Vietnamese'=>'ვიეტნამური','Ukrainian'=>'უკრაინული','Turkish'=>'თურქული','Thai'=>'ტაილანდური','Tagalog'=>'ტაგალოგი','Swedish'=>'შვედური','Swahili'=>'სუაჰილი','Spanish'=>'ესპანური','Slovenian'=>'სლოვენიური','Slovak'=>'სლოვაკური','Serbian'=>'სერბული','Russian'=>'რუსული','Romanian'=>'რუმინული','Portuguese'=>'პორტუგალიური','Polish'=>'პოლონური','Persian'=>'სპარსული','Norwegian'=>'ნორვეგიული','Maltese'=>'მალტური','Malay'=>'მალაიზიური','Macedonian'=>'მაკედონიური','Lithuanian'=>'ლიტვური','Latvian'=>'ლატვიური','Korean'=>'კორეული','Japanese'=>'იაპონური','Italian'=>'იტალიური','Irish'=>'ირლან