###SITEURL###','Scrape key check failed. Please try again.'=>'შეცდომა nonce-ის შემოწმებისას. გთხოვთ სცადოთ ხელმეორედ.','Only UUID V4 is supported at this time.'=>'ამჟამად მხარდაჭერილია მხოლოდ UUID V4.','The Press This plugin is required.'=>'Press This პლაგინი სავალდებულოა.','%s themes'=>'%s თემა','Filter themes (%s)'=>'თემების ფილტრი (%s)','Go to theme sources'=>'უკან, თემების წყაროზე','Search WordPress.org themes'=>'თემების ძებნა WordPress.org-ზე','Install &amp; Preview'=>'ინსტალაცია და წინასწარი დათვალიერება','Invalid URL.'=>'არასწორი მისამართი.','Time to add some links! Click &#8220;%s&#8221; to start putting pages, categories, and custom links in your menu. Add as many things as you would like.'=>'დროა დაამატოთ რამდენიმე ბმული! დააწკაპუნეთ „მენიუს ელემენტის დამატება“, გვერდების, კატეგორიების და მორგებული ბმულების მენიუში დასამატებლად. დაამატეთ იმდენი, რამდენიც გსურთ.','Choose image'=>'სურათის არჩევა','Choose audio'=>'აუდიო არჩევა','Change audio'=>'აუდიოს შეცვლა','Select audio'=>'აუდიო არჩევა','Click &#8220;Add New Image&#8221; to upload an image file from your computer. Your theme works best with an image with a header height of %s pixels &#8212; you&#8217;ll be able to crop your image once you upload it for a perfect fit.'=>'დააწკაპუნეთ ბმულზე „მედია-ფაილის დამატება“, სურათის კომპიუტერიდან ასატვირთად. თქვენი თემა ყველაზე კარგად გამოიყურება ქუდის სურათით, რომლის სიმაღლე %s პიქსელია. შეგიძლიათ მოაჭრათ სურათს, რათა ის იდეალურად გამოიყურებოდეს.','Click &#8220;Add New Image&#8221; to upload an image file from your computer. Your theme works best with an image with a header width of %s pixels &#8212; you&#8217;ll be able to crop your image once you upload it for a perfect fit.'=>'დააწკაპუნეთ ბმულზე „მედია-ფაილის დამატება“, სურათის კომპიუტერიდან ასატვირთად. თქვენი თემა ყველაზე კარგად გამოიყურება ქუდის სურათით, რომლის სიგანე %s პიქსელია. შეგიძლიათ მოაჭრათ სურათს, რათა ის იდეალურად გამოიყურებოდეს.','Click &#8220;Add New Image&#8221; to upload an image file from your computer. Your theme works best with an image with a header size of %s pixels &#8212; you&#8217;ll be able to crop your image once you upload it for a perfect fit.'=>'დააწკაპუნეთ ბმულზე „მედია-ფაილის დამატება“, სურათის კომპიუტერიდან ასატვირთად. თქვენი თემა ყველაზე კარგად გამოიყურება ქუდის სურათით, როდესაც ქუდის სიმაღლე %s პიქსელია. შეგიძლიათ მოაჭრათ სურათს, რათა ის იდეალურად გამოიყურებოდეს.','Click &#8220;Add New Image&#8221; to upload an image file from your computer. Your theme works best with an image that matches the size of your video &#8212; you&#8217;ll be able to crop your image once you upload it for a perfect fit.'=>'დააწკაპუნეთ ბმულზე „მედია-ფაილის დამატება“, სურათის კომპიუტერიდან ასატვირთად. თქვენი თემა ყველაზე კარგად გამოიყურება ქუდის სურათით, რომელიც ემთხვევა ვიდეოს ზომას. შეგიძლიათ მოაჭრათ სურათს, რათა ის იდეალურად გამოიყურებოდეს.','%1$s-%2$s'=>'%1$s-%2$s','Minute'=>'წუთი','Hour'=>'საათი','Time'=>'დრო','Day'=>'დღე','Month'=>'თვე','Date'=>'თარიღი','Name for the Visual editor tabVisual'=>'ვიზუალური','Meridian'=>'მერიდიანი','Usage of user levels is deprecated. Use capabilities instead.'=>'მომხმარებელთა დონეების გამოყენება მოძველდა. გამოიყენეთ შესაძლებლობები.','The theme defines itself as its parent theme. Please check the %s header.'=>'თემა განსაზღვრავს საკუთარ თავს, როგორც მშობელს საკუთარი თავისათვის. გთხოვთ შეამოწმოთ სათაური %s.','Create New Menu'=>'ახალი მენიუს შექმნა','New Menu'=>'ახალი მენიუ','If your theme has widget areas, you can also add menus there. Visit the <a href="%s">Widgets panel</a> and add a &#8220;Navigation Menu widget&#8221; to display a menu in a sidebar or footer.'=>'თუ თემას აქვს ვიჯეტების არე, თქვენ შეგიძლიათ იქ მენიუს დამატებაც. შედით <a href="%s">ვიჯეტების პანელში</a> და დაამატეთ „ნავიგაციის მენიუს ვიჯეტი“, რათა გამოჩნდეს მენიუ გვერდითა ზოლში, ან სარდაფში.','If your theme has multiple menus, giving them clear names will help you manage them.'=>'თუ თქვენს თემას აქვს რამდენიმე მენიუს მხარდაჭერა, დაარქვით მათ გასაგები სახელები, რათა გაგიადვილდეთ მათი მართვა.','Your theme can display menus in one location.'=>'თქვენს თემას შეუძლია მენიუს ჩვენება ერთ ადგილას.','CSS code'=>'CSS-კოდი','Screen reader users: when in forms mode, you may need to press the Esc key twice.'=>'ეკრანული წამკითხველის გამოყენებისას: ფორმების რეჟიმში საჭირო იქნება Esc-კლავიშის ორჯერ დაჭერა.','To move away from this area, press the Esc key followed by the Tab key.'=>'ამ არედან გასასვლელად, ჯერ დააჭირეთ Esc-კლავიშზე და შემდეგ Tab-ზე.','In the editing area, the Tab key enters a tab character.'=>'რედაქტირების არეში Tab სვამს ტაბულაციის სიმბოლოს.','When using a keyboard to navigate:'=>'ნავიგაციისათვის კლავიატურის გამოყენებისას:','Add your own CSS code here to customize the appearance and layout of your site.'=>'დაამატეთ საკუთარი CSS-კოდი თქვენი საიტის მაკეტისა და გარეგანის სახის მოსარგებად.','Your homepage displays'=>'მთავარ საიტზე გამოისახოს','You can choose what&#8217;s displayed on the homepage of your site. It can be posts in reverse chronological order (classic blog), or a fixed/static page. To set a static homepage, you first need to create two Pages. One will become the homepage, and the other will be where your posts are displayed.'=>'შეგიძლიათ აირჩიოთ ის, რა გამოჩნდება თქვენი საიტის მთავარ გვერდზე. ეს შეიძლება იყოს ჩანაწერები ქრონოლოგიურად (კლასიკური ბლოგი), ან მუდმივი (სტატიკური) გვერდი. სტატიკური მთავარი გვერდის დასაყენებლად, თქვენ უნდა შექმნათ ორი გვერდი. ერთი გახდება მტავარი გვერდი, ხოლო მეორე — ბლოგის ჩანაწერებისათვის.','The edit field automatically highlights code syntax. You can disable this in your <a href="%1$s" %2$s>user profile%3$s</a> to work in plain text mode.'=>'ჩასწორების ველი ავტომატურად გამოანათებს კოდის სინტაქსს. თქვენ შეგიძლიათ გამორთოთ ეს ფუქნცია <a href="%1$s" %2$s>მომხმარებლის პროფილში%3$s</a> და განაგრძოთ მუშაობა ჩველებრივი ტექსტის გამოყენებით.','Your theme can display menus in %s location.'=>'თქვენს თემას შეუძლია მენიუს ჩვენება %s მდებარეობაში.','Homepage Settings'=>'მთავარი გვერდის პარამეტრები','Publish Settings'=>'გამოქვეყნების პარამეტრები','WordPress.org themes'=>'WordPress.org-ის თემები','Installed themes'=>'დაყენებული თემები','Copied'=>'კოპირებულია','Preview Link'=>'ბმული წინასწარ დათვალიერებაზე','See how changes would look live on your website, and share the preview with people who can\'t access the Customizer.'=>'ნახეთ, როგორ გამოჩნდება ცვლილებები თქვენს საიტზე და გაუზიარეთ მათ, ვისაც არა აქვს წვდომა პარამეტრებზე.','Share Preview Link'=>'წინასწარი დათვალიერების ბმულის გაზიარება','Changes trashed successfully.'=>'ცვლილებები გადაადგილდა სანაგვეში.','Changes have already been trashed.'=>'ცვლილებები უკვე გადაადგილდა სანაგვეში.','Unable to trash changes.'=>'შეუძლებელია ცვლილებების გადაადგილება სანაგვეში.','No changes saved yet, so there is nothing to trash.'=>'ცვლიებები არ არის შენახული, ამიტომ წასაშლელიც არაფერია.','There was an authentication problem. Please reload and try again.'=>'წარმოიშვა ავტორიზაციის პრობლემა. გთხოვთ გადატვირთოთ და ხელახლა სცადოთ.','You must supply a future date to schedule.'=>'უნდა მიუთითოთ დრო მომავალში, დაგეგმისათვის.','Unable to save due to %s invalid setting.'=>'შეუძლებელია შენახვა %s არასწორი პარამეტრის გამო.','Edit User'=>'მომხმარებლის ჩასწორებს','The previous set of changes has already been published. Please try saving your current set of changes again.'=>'ცვლილებების წინა ნაკრები უკვე გამოქვეყნდა. გთხოვთ ახლიდან სცადოთ ცვლილებების მიმდინარე ნაკრების შენახვა.','View User'=>'მომხმარებლის ნახვა','This widget may have contained code that may work better in the &#8220;Custom HTML&#8221; widget. If you have not yet, how about trying that widget instead?'=>'ამ ვიჯეტში შესაძლოა ყოფილიყო კოდი, რომელიც შესაძლოა უკეთ იმუშავებს ახალ ვიჯეტში „HTML-კოდი“. არ გინდათ სცადოთ?','Hey there, looks like you just pasted HTML into the &#8220;Visual&#8221; tab of the Text widget. You may want to paste your code into the &#8220;Text&#8221; tab instead. Alternately, try out the new &#8220;Custom HTML&#8221; widget!'=>'ჰეი! ისე ჩანს, თითქოს ეს-ესაა HTML-კოდი ჩასვით ვიჯეტის „ტექსტი“ ვიზუალურ რედაქტორში. ალბათ უმჯობესი იქნება ამ კოდის ჩასმა ჩანართში „ტექსტი“, ანდა სცადეთ ახალი ვიჯეტი „HTML-კოდი“!','Did you just paste HTML?'=>'თქვენ ახლა HTML-კოდი ჩასვით?','Did you know there is a &#8220;Custom HTML&#8221; widget now? You can find it by scanning the list of available widgets on this screen. Check it out to add some custom code to your site!'=>'იცით, რომ ახლა არსებობს ვიჯეტი „HTML-კოდი“? მისი მოძებნა შესაძლებელია ხელმისაწვდომი ვიჯეტების სიაში. სცადეთ მისი გამოყენება მორგებული კოდის ჩასასმელად!','Did you know there is a &#8220;Custom HTML&#8221; widget now? You can find it by pressing the &#8220;<a class="add-widget" href="#">Add a Widget</a>&#8221; button and searching for &#8220;HTML&#8221;. Check it out to add some custom code to your site!'=>'იცით, რომ ახლა არსებობს ვიჯეტი „HTML-კოდი“? მისი მოძებნა შესაძლებელია ღილაკზე <a class="add-widget" href="#">ვიჯეტის ჩასმა</a> დაჭერით. სცადეთ მისი გამოყენება მორგებული კოდის ჩასასმელად!','Arbitrary text.'=>'შემთხვევითი ტექსტი.','New Custom HTML Widget'=>'ახალი მორგებული HTML-კოდის ვიჯეტი','This widget may contain code that may work better in the &#8220;Custom HTML&#8221; widget. How about trying that widget instead?'=>'ეს ვიჯეტი შესაძლოა შეიცავდეს კოდს, რომელიც უკეთ იმუშავებს ვიჯეტში „HTML-კოდი“. არ გინდათ სცადოთ მისი გამოყენება?','Custom HTML'=>'მორგებული HTML','Arbitrary HTML code.'=>'შემთხვევითი HTML-კოდი.','Some HTML tags are not permitted, including:'=>'ზოგიერთი HTML ტეგი მიუწვდომელია, მათ შორის:','Show tag counts'=>'ჭდეების რაოდენობის ჩვენება','%s item'=>'%s ერთეული','label for button in the media widgetAdd Media'=>'ფოტო/ვიდეოს დამატება','label for button in the video widgetAdd Video'=>'ვიდეოს დამატება','label for button in the image widgetAdd Image'=>'სურათის დამატება','label for button in the audio widgetAdd Audio'=>'აუდიოს დამატება','(no author)'=>'(ავტორის გარეშე)','To change or disable registration go to your <a href="%s">Options page</a>.'=>'პარამეტრების შესაცვლელად, ან რეგისტრაციის გამოსართავად გადადით <a href="%s">პარამეტრების გვერდზე</a>.','The network currently allows both site and user registrations.'=>'ქსელში ნებადართულია საიტებისა და მომხმარებლების რეგისტრაცია.','The network currently allows user registrations.'=>'ქსელში ნებადართულია მომხმარებლების რეგისტრაცია.','The network currently allows site registrations.'=>'ქსელში ნებადართულია საიტებისა რეგისტრაცია.','The network currently disallows registrations.'=>'ქსელში ნებადართული არ არის რეგისტრაცია.','Greetings Network Administrator!'=>'მოგესალმებით ქსელის ადმინისტრატორო!','Title for the widget'=>'ვიჯეტის სახელი','URL to the media file'=>'მედია-ფაილის URL-მისამართი','Attachment post ID'=>'დანართის ჩანაწერის ID','Looks like this is not the correct kind of file. Please link to an appropriate file instead.'=>'როგორც ჩანს, ფაილის ტიპი არასწორია. გთხოვთ შექმნათ ბმული მისაღებ ფაილზე.','Media Widget'=>'მედია ვიჯეტი','Add to Widget'=>'ვიჯეტში დამატება','label for button in the media widget; should preferably not be longer than ~13 characters longEdit Media'=>'ჩასწორება','label for button in the media widget; should preferably not be longer than ~13 characters longReplace Media'=>'ჩანაცვლება','No media selected'=>'მედია არჩეული არ არის','A media item.'=>'მედია-ელემენტი.','URL to the %s video source file'=>'URL-მისამართი %s ვიდეოს წყაროზე','Video Widget'=>'ვიდეო ვიჯეტი','Media Widget (%d)'=>'მედია ვიჯეტი (%d)','Video Widget (%d)'=>'ვიდეო ვიჯეტი (%d)','label for button in the video widget; should preferably not be longer than ~13 characters longEdit Video'=>'ჩასოწრება','label for button in the video widget; should preferably not be longer than ~13 characters longReplace Video'=>'ჩანაცვლება','Displays a video from the media library or from YouTube, Vimeo, or another provider.'=>'აჩვენებს ვიდეოს მედია ბიბლიოთეკიდან, ან YouTube, Vimeo, ან სხვა ნაკადიდან.','Image Widget'=>'სურათის ვიჯეტი','label for button in the image widget; should preferably not be longer than ~13 characte