ას.','Your theme has 1 other widget area, but this particular page does not display it.'=>'თქვენს თემას აქვს 1 სხვა ვიჯეტის არე, მაგრამ ეს კონკრეტული გვერდი არ აჩვენებს მას.','Your theme has 1 widget area, but this particular page does not display it.'=>'თქვენს თემას აქვს 1 ვიჯეტის არე, მაგრამ ეს კონკრეტული გვერდი არ აჩვენებს მას.','This address is used for admin purposes, like new user notification.'=>'ეს მისამართი გამოიყენება ადმინისტრაციული მიზნებისათვის. როგორც, მაგალითად ახალი მომხმარებლისთვის შეტყობინების გაგზავნა.','Unique identifier for the term.'=>'ელემენტის უნიკალური იდენტიფიკატორი.','An alphanumeric identifier for the taxonomy.'=>'ციფრულ-ანბანური იდენტიფიკატორი ტაქსონომიისათვის.','An alphanumeric identifier for the post type.'=>'ციფრულ-ანბანური იდენტიფიკატორი ჩანაწერისათვის.','A human-readable description of the post type.'=>'ჩანაწერის ტიპის ადამიანის მიერ აღქმადი აღწერა.','All capabilities used by the post type.'=>'ყველა შესაძლებლობა გამოიყენება ჩანაწერის ტიპის მიერ.','Human-readable labels for the post type for various contexts.'=>'ჩანაწერის ტიპის ადამიანის მიერ აღქმადი აღწერა სხვადასხვა ტიპის შიგთავსისათვის.','Required to be true, as terms do not support trashing.'=>'უნდა იყოს ჭეშმარიტი, ვინაიდან არ შეიძლება ელემენტების სანაგვეში გადატანა.','Required to be true, as revisions do not support trashing.'=>'უნდა იყოს ჭეშმარიტი, ვინაიდან არ შეიძლება რევიზიების სანაგვეში გადატანა.','REST base route for the post type.'=>'REST-ის საბაზო მდებარეობა ჩანაწერის ტიპისათვის.','Whether or not the post type should have children.'=>'შეიძლება, თუ არა, რომ ეს ჩანაწერი იყოს მშობელი.','An alphanumeric identifier for the status.'=>'ციფრულ-ანბანური იდენტიფიკატორი სტატუსისათვის.','Limit response to comments published before a given ISO8601 compliant date.'=>'პასუხის შეზღუდვა ISO8601-თან თავსებად თარიღმდე გამოქვეყნებული კომენტარებით.','Limit response to comments published after a given ISO8601 compliant date.'=>'პასუხის შეზღუდვა ISO8601-თან თავსებადი თარიღის შემდეგ გამოქვეყნებუ