 NY 10001'=>'New York, NY 10001','Theme starter content123 Main Street'=>'123 Main Street','Theme starter contentMonday&ndash;Friday: 9:00AM&ndash;5:00PM'=>'ორშაბათი-პარასკევი: დილის 9:00-17:00','Theme starter contentAddress'=>'მისამართი','Theme starter contentFind Us'=>'გვიპოვნეთ ჩვენ','Invalid user parameter(s).'=>'მომხმარებლ(ებ)ის არასწორი პარამეტრები.','Passwords cannot contain the "%s" character.'=>'პაროლი არ უნდა შეიცავდეს "\\" სიმბოლოს.','Passwords cannot be empty.'=>'პაროლი არ შეიძლება იყოს ცარიელი.','label for hide controls button without length constraintsShow Controls'=>'კონტროლების ჩვენება','label for hide controls button without length constraintsHide Controls'=>'კონტროლების დამალვა','Document Preview'=>'დოკუმენტის დათვალიერება','Header Media'=>'ქუდის მედია-ფაილი','+ %s'=>'+ %s','REST base route for the taxonomy.'=>'REST-ის საბაზო მდებარეობა ტაქსონომიისათვის.','default site languageSite Default'=>'ნაგულისხმევად საიტისათვის','Caption for the attachment, as it exists in the database.'=>'ხელმოწერა დანართისათვის, როგორც ის არსებობს მონაცემთა ბაზაში.','HTML caption for the attachment, transformed for display.'=>'HTML სათაური დანართისათვის, გარდაქმნილი საჩვენებლად.','Description for the attachment, as it exists in the database.'=>'ობიექტის აღწერილობა, როგორც ის არის მონაცემთა ბაზაში.','HTML description for the attachment, transformed for display.'=>'HTML სათაური დანართისათვის, გარდაქმნილი საჩვენებლად.','Please enter a valid YouTube URL.'=>'გთხოვთ შეიტანოთ YouTube-ის სწორი მისამართი.','Or, enter a YouTube URL:'=>'ან შეიტანეთ YouTube-ის ბმული:','Terms do not support trashing. Set \'%s\' to delete.'=>'არ შეიძლება ელემენტების სანაგვეში გადატანა. დააყენეთ \'%s\' წაშლაზე.','Revisions do not support trashing. Set \'%s\' to delete.'=>'არ შეიძლება რევიზიების სანაგვეში გადატანა. დააყენეთ \'%s\' წაშლაზე.','The comment does not support trashing. Set \'%s\' to delete.'=>'არ შეიძლება კომენტარის სანაგვეში გადატანა. დააყენეთ \'%s\' წაშლაზე.','Users do not support trashing. Set \'%s\' to delete.'=>'არ შეიძლება მომხმარებლების სანაგვეში გადატანა. დააყენეთ \'%s\' წაშლაზე.','The post does not support trashing. Set \'%s\' to delete.'=>'არ შეიძლება ჩანაწერის სანაგვეში გადატანა. დააყენეთ \'%s\' წაშლაზე.','Invalid JSON body passed.'=>'გაგზავნილია JSON-მოთხოვნის არასწორი სხეული.','Comment field exceeds maximum length allowed.'=>'კომენტარის ველი აჭარბებს მაქსიმალურად დასაშვებ ზომას.','Limit result set to posts assigned one or more statuses.'=>'შერჩევის შეზღუდვა ჩანაწერებზე ერთი, ან რამდენიმე სტატუსით.','Taxonomies associated with post type.'=>'ტაქსონიმია, დაკავშირებული ამ ტიპის ჩანაწერთან.','Limit result set to posts with one or more specific slugs.'=>'შერჩევის შეზღუდვა ჩანაწერებზე გარკვეული იარლიყით.','Comment is required.'=>'კომენტარი სავალდებულოა.','Empty title.'=>'ცარიელი სათაური.','I really need an ID for this to work.'=>'მე მართლა მჭირდება ID ამ საქმის შესასრულებლად.','Sorry, trackbacks are closed for this item.'=>'უკაცრავად, უკუ ბმულები გამორთულია.','Homepage'=>'მთავარი','%1$s must be between %2$d (inclusive) and %3$d (inclusive)'=>'%1$s უნდა იყოს %2$d-სა (ჩათვლით) და %3$d-ს (ჩათვლით) შორის','%1$s must be between %2$d (exclusive) and %3$d (inclusive)'=>'%1$s უნდა იყოს %2$d-სა (გარეშე) და %3$d-ს (ჩათვლით) შორის','%1$s must be between %2$d (inclusive) and %3$d (exclusive)'=>'%1$s უნდა იყოს %2$d-სა (ჩათვლით) და %3$d-ს (გარეშე) შორის','%1$s must be between %2$d (exclusive) and %3$d (exclusive)'=>'%1$s უნდა იყოს %2$d-სა (გარეშე) და %3$d-ს (გარეშე) შორის','%s is not a valid IP address.'=>'%s არ არის მართებული IP-მისამართი.','%1$s is not of type %2$s.'=>'%1$s არ არის ტიპი %2$s.','%1$s is not one of %2$s.'=>'%1$s არ მიეკუთვნება %2$s.','Could not delete meta value from database.'=>'შეუძლებელია მეტა მონაცემების წაშლა მონაცემთა ბაზიდან.','Any extra capabilities assigned to the user.'=>'დამატებითი შესაძლებლობა მინიჭებულია მომხმარებელზე.','Meta fields.'=>'მეტა ველები.','Limit result set to users matching at least one specific role provided. Accepts csv list or single role.'=>'შერჩევის შეზღუდვა მომხმარებლებით, რომლებიც აკმაყოფილებენ სულ მცირე ერთ მითითებულ როლს. შესაძლებელია CSV-სიის მითითება, ან ერთი როლის.','All capabilities assigned to the user.'=>'ყველა შესაძლებლობა მინიჭებულია მომხმარებელზე.','Password for the user (never included).'=>'მომხმარებლის პაროლი (არასდროს არ ჩანს).','Registration date for the user.'=>'მომხმარებლის რეგისტრაციის თარიღი.','The email address for the user.'=>'მომხმარებლის ელფოსტის მისამართი.','Invalid user ID for reassignment.'=>'მომხმარებლის ID-ის არასწორი მნიშვნელობა გადანიშვნისათვის.','Sorry, you are not allowed to delete this user.'=>'უკაცრავად, არ გაქვთ ამ მომხმარებლის წაშლის უფლება.','The role %s does not exist.'=>'როლი %s არ არსებობს.','Username is not editable.'=>'მომხმარებლის სახელი ვერ შეიცვლება.','Cannot create existing user.'=>'შეუძლებელია უკვე არსებული მომხმარებლის შექმნა.','Sorry, you are not allowed to edit roles of this user.'=>'უკაცრავად, არ გაქვთ ამ მომხმარებლის როლების ჩასწორების უფლება.','You are not currently logged in.'=>'თქვენ არ ხართ შესული.','Sorry, you are not allowed to delete this revision.'=>'უკაცრავად, არ გაქვთ ამ რევიზიის წაშლის უფლება.','An alphanumeric identifier for the term unique to its type.'=>'ციფრულ-ანბანური იდენტიფიკატორი უნიკალურია ელემენტისათვის.','Limit result set to terms assigned to a specific post.'=>'შერჩევის შეზღუდვა ელემენტებზე გარკვეული ჩანაწერით.','Limit result set to terms assigned to a specific parent.'=>'შერჩევის შეზღუდვა ელემენტებზე გარკვეული მშობელით.','Sort collection by term attribute.'=>'კოლექციის დახარისხება ელემენტის ატრიბუტის მიხედვით.','Whether to hide terms not assigned to any posts.'=>'დაიმალოს, თუ არა ელემენტები, რომლებიც არავიზე არ არის დანიშნული.','Type attribution for the term.'=>'ელემენტის ატრიბუციის ტიპი.','The ID for the parent of the revision.'=>'რევიზიის მშობლის ID.','HTML description of the term.'=>'HTML აღწერილობა ელემენტისათვის.','Number of published posts for the term.'=>'ელემენტის გამოქვეყნებული ჩანაწერების რაოდენობა.','Unique identifier for the user.'=>'მომხმარებლის უნიკალური იდენტიფიკატორი.','The template cannot be deleted.'=>'შაბლონების წაშლა შეუძლებელია.','Limit results to taxonomies associated with a specific post type.'=>'შერჩევის შეზღუდვა ტაქსონომიით, რომელიც ასოცირებულია ჩანაწერის გარკვეულ ტიპთან.','Invalid revision ID.'=>'რევიზიის არასწორი ID.','Limit result set to items that are sticky.'=>'შერჩევა შეზღუდულია თანდართული ობიექტებით.','Required to be true, as users do not support trashing.'=>'უნდა იყოს ჭეშმარიტი, ვინაიდან არ შეიძლება მომხმარებლების სანაგვეში გადატანა.','The %s property has an invalid stored value, and cannot be updated to null.'=>'%s თვისება შეიცავს არასწორ შენახულ მნიშვნელობას და ვერ განახლდება null-ზე.','Status is forbidden.'=>'სტატუსი აკრძალულია.','Whether or not the term cloud should be displayed.'=>'გამოჩნდეს, თუ არა ელემენტების ღრუბელი.','Ensure result set excludes posts assigned to specific authors.'=>'დარწმუნდით, რომ ნაკრები გამორიცხავს კონკრეტულ მომხმარებლზე დანიშნულ ჩანაწერებს.','Limit result set to items except those with specific terms assigned in the %s taxonomy.'=>'შერჩევის შეზღუდვა ობიექტებზე, რომლებსაც გააჩნიათ დანიშნული ელემენტები %s ტაქსონომიაში.','Limit result set to all items except those of a particular parent ID.'=>'შერჩევის შეზღუდვა ობიექტებზე, გარდა იმ ობიექტებისა, რომლებსაც გააჩნიათ გარკვეული ID.','Limit result set to items with particular parent IDs.'=>'შერჩევის შეზღუდვა გარკვეული მშობელი ID-ით.','Limit result set to posts with a specific menu_order value.'=>'შერჩევის შეზღუდვა ჩანაწერებზე menu_order value მნიშვენლობით.','Limit result set to posts assigned to specific authors.'=>'შერჩევის შეზღუდვა ჩანაწერებზე გარკვეული ავტორით.','Offset the result set by a specific number of items.'=>'ნაკრების წანაცვლება ობიექტების გარკევულ რაოდენობაზე.','The terms assigned to the post in the %s taxonomy.'=>'ჩანაწერისათვის მინიჭებული პირობები %s ტაქსონომიაში.','A password to protect access to the content and excerpt.'=>'შიგთავსისა და ნაწყვეტის პაროლით დაცვა.','Whether the excerpt is protected with a password.'=>'დაცულია, თუ არა მონაკვეთი პაროლით.','HTML excerpt for the post, transformed for display.'=>'HTML მონაკვეთი ობიექტისათვის, გარდაქმნილი საჩვენებლად.','The format for the post.'=>'ჩანაწერის ფორმატი.','The ID of the featured media for the post.'=>'ჩანაწერის რჩეული მედიის ID.','The theme file to use to display the post.'=>'თემის ფაილი გამოიყენება ჩანაწერის საჩვენებლად.','Whether or not comments are open on the post.'=>'გახსნილია, თუ არა კომენტარები ჩანაწერისათვის.','Whether or not the post can be pinged.'=>'იღებს, თუ არა ჩანაწერი შეტყობინებებს.','Whether or not the post should be treated as sticky.'=>'ჩაითვალოს, თუ არა ობიექტი მიჭიკარტებულათ.','Whether the content is protected with a password.'=>'დაცულია, თუ არა შიგთავსი პაროლით.','The title for the object.'=>'ობიეტის სათაური.','A named status for the post.'=>'პოსტის დასახელებული სტატუსი.','An alphanumeric identifier for the revision unique to its type.'=>'ციფრულ-ანბანური იდენტიფიკატორი უნიკალურია ელემენტისათვის.','Excerpt for the post, as it exists in the database.'=>'ობიექტის მონაკვეთი, როგორც ის არსებობს მონაცემთა ბაზაში.','HTML title for the post, transformed for display.'=>'HTML სათაური ობიექტისათვის, გარდაქმნილი საჩვენებლად.','The excerpt for the post.'=>'ჩანაწერის ამონარიდი.','The ID for the author of the post.'=>'ჩანაწერის ავტორის ID.','Title for the post, as it exists in the database.'=>'ჩანაწერის სათაური, როგორც ის არის მონაცემთა ბაზაში.','A password protected post can not be set to sticky.'=>'პაროლით დაცული ჩანაწერი ვერ მიჭიკარტდება.','A sticky post can not be password protected.'=>'მიჭიკარტებული ჩანაწერი ვერ იქნება დაცული პაროლით.','Invalid featured media ID.'=>'არჩეული მედიის არასწორი ID.','Invalid post parent ID.'=>'მშობელი ჩანაწერის არასწორი ID.','GUID for the post, transformed for display.'=>'GUID პოსტისთვის, გარდაქმნილია ჩვენებისთვის.','GUID for the revision, as it exists in the database.'=>'GUID გადასინჯვისთვის, რადგან ის არსებობს მონაცემთა ბაზაში.','The date the revision was last modified, as GMT.'=>'გადახედვის ბოლოს შეცვლის თარიღი, როგორც GMT.','The date the revision was last modified, in the site\'s timezone.'=>'ობიექტის ცვლილების ბოლო თარიღი, საიტის დროის სარტყელის მიხედვით.','The date the revision was published, as GMT.'=>'გადახედვის ბოლოს შეცვლის თარიღი, როგორც GMT.','The date the revision was published, in the site\'s timezone.'=>'ობიექტის გამოქვეყნების თარიღი საიტის ფორმატში.','The globally unique identifier for the post.'=>'იდენტიფიკატორი უნიკალურია ელემენტისათვის.','A post can not be sticky and have a password.'=>'ჩანაწერი ვერ იქნება მიჭიკარტებული და ვერ ექნება პაროლი.','Cannot create existing post.'=>'შეუძლებელია უკვე არსებული ჩანაწერის შექმნა.','Sorry, you are not allowed to edit comments.'=>'უკაცრავად, არ გაქვთ კომენტარების ჩასწორების უფლება.','Sorry, you are not allowed to create new users.'=>'უკაცრავად, არ გაქვთ ახალი მომხმარებლების შექმნის უფლება.','The post has already been deleted.'=>'ჩანაწერი უკვე წაიშლა.','Sorry, you are not allowed to manage this plugin.'=>'უკაცრავად, არ გაქვთ ამ ელემენტის მართვის უფლება.','Incorrect post password.'=>'ჩანაწერის არასწორი პაროლი.','You need to define a search term to order by relevance.'=>'უნდა განსაზღვროთ ძებნის პირობები რელევანტურობის მიხედვით.','The password for the post if it is password protected.'=>'პაროლი ჩანაწერისათვის, თუ ის დაცულია პაროლით.','A human-readable description of the taxonomy.'=>'ტაქსონომიის ადამიანის მიერ აღქმადი აღწერა.','All capabilities used by the taxonomy.'=>'ყველა შესაძლებლობა გამოიყენება ტაქსონომიის მიერ.','An alphanumeric identifier for the user.'=>'ციფრულ-ანბანური იდენტიფიკატორი მომხმარებლისათვის.','Human-readable labels for the taxonomy for various contexts.'=>'ტაქსონომიის ადამიანის მიერ აღქმადი აღწერა სხვადასხვა ტიპის შიგთავსისათვის.','Whether or not the taxonomy should have children.'=>'შეიძლება, თუ არა, რომ ეს ტაქსონიმია იყოს მშობელი.','Whether to include posts in the edit listing for their post type.'=>'ჩაემატოს, თუ არა ჩანაწერები ჩასწორების სიაში, მათი ტიპის ჩანაწერებისათვის.','Whether posts with this status should be publicly-queryable.'=>'ნება დაერთოს, თუ არა ჩანაწერების საჯარო მოთხოვნებს ამ სტატუსით.','Whether posts of this status should be shown in the front end of the site.'=>'გამოჩნდეს, თუ არა ჩანაწერები ამ სტატუსით საიტის მომხმარებელთა ნაწილში.','Whether posts with this status should be protected.'=>'უნდა იყოს, თუ არა ეს სტატუსი დაცული.','Sorry, you are not allowed to manage post statuses.'=>'უკაცრავად, არ გაქვთ ჩანაწერის სტატუსის მართვის უფლება.','Current page of the collection.'=>'კოლექციის მიმდინარე გვერდი.','Limit results to those matching a string.'=>'შერჩევის შეზღუდვა თანხვედრილი სტრიქონით.','Maximum number of items to be returned in result set.'=>'ნაკრებში დაბრუნებული ობიექტების მაქსიმალური რაოდენობა.','Method \'%s\' not implemented. Must be overridden in subclass.'=>'მეთოდი \'%s\' არ არის განხორციელებული. სავალდებულია ქვე-კლასში გარდაქმნა.','Scope under which the request is made; determines fields present in response.'=>'ჩარჩოები, რომელთა ფარგლებში გაკეთდა მოთხოვნა, განსაზღვრავენ ველებს პასუხში.','Whether posts with this status should be private.'=>'უნდა იყოს, თუ არა ეს სტატუსი პრივატული.','Ensure result set excludes specific parent IDs.'=>'დარწმუნდით, რომ ნაკრები გამორიცხავს კონკრეტულ მშობელ ID-ის.','Limit result set to comments assigned a specific type. Requires authorization.'=>'შერჩევის შეზღუდვა კომენტარებზე გარკვეული ტიპით. მოითხოვს ავტორიზაციას.','Limit result set to comments assigned a specific status. Requires authorization.'=>'შერჩევის შეზღუდვა კომენტარებზე გარკვეული სტატუსით. მოითხოვს ავტორიზაციას.','Limit result set to comments assigned to specific post IDs.'=>'შერჩევის შეზღუდვა კომენტარებზე გარკვეული ID ჩანაწერით.','Limit result set to comments of specific parent IDs.'=>'შერჩევის შეზღუდვა კომენტარებზე გარკვეული მშობელი ID ჩანაწერით.','Sort collection by object attribute.'=>'კოლექციის დახარისხება ობიექტის ატრიბუტის მიხედვით.','Order sort attribute ascending or descending.'=>'ატრიბუტის დახარისხების მოწესრიგება ზრდადობით, ან კლებადობით.','Ensure result set excludes specific IDs.'=>'დარწმუნდით, რომ ნაკრები გამორიცხავს კონკრეტულ ID-ის.','Ensure result set excludes comments assigned to specific user IDs. Requires authorization.'=>'დარწმუნდით, რომ ნაკრები გამორიცხავს კონკრეტულ მომხმარებლის ID-ზე დანიშნულ კომენტარებს. მოითხოვს ავტორიზაციას.','Avatar URL with image size of %d pixels.'=>'%d ზომის ავატარის URL-მისამართი.','Limit result set to specific IDs.'=>'შერჩევის შეზღუდვა ჩანაწერებზე გარკვეული ID-ით.','Limit response to posts published before a given ISO8601 compliant date.'=>'პასუხის შეზღუდვა ISO8601-თან თავსებად თარიღამდე გამოქვეყნებული ჩანაწერებით.','Limit result set to that from a specific author email. Requires authorization.'=>'შერჩევის შეზღუდვა გარკვეული ელფოსტის მქონე ავტორით. მოითხოვს ავტორიზაციას.','Limit result set to comments assigned to specific user IDs. Requires authorization.'=>'შერჩევის შეზღუდვა კომენტარებზე გარკვეული მომხმარებლის ID ჩანაწერით. მოითხოვს ავტორიზაციას.','Limit response to posts published after a given ISO8601 compliant date.'=>'პასუხის შეზღუდვა ISO8601-თან თავსებადი თარიღის შემდეგ გამოქვეყნებული ჩანაწერებით.','Avatar URLs for the comment author.'=>'ავატარის მისამართები კომენტარის ავტორისთვის.','The ID of the associated post object.'=>'ობიექტთან ასოცირებული ჩანაწერების ID.','The ID for the parent of the post.'=>'ობიექტის მშობელის ID.','URL to the object.'=>'ობიექტის მისამართი.','Content for the post, as it exists in the database.'=>'ობიექტის შიგთავსი, როგორც ის არის მონაცემთა ბაზაში.','HTML content for the post, transformed for display.'=>'HTML შიგთავსი ობიექტისათვის, გარდაქმნილი საჩვენებლად.','State of the comment.'=>'კომენტარის მდგომარეობა.','The content for the post.'=>'შინაარსი ჩანაწერისათვის.','The date the post was published, as GMT.'=>'შეტყობინების გამოქვეყნების თარიღი, როგორც GMT.','Invalid comment author ID.'=>'კომენტარის ავტორის არასწორი ID.','The comment 