e what these terms mean you should probably contact your host. If you still need help you can always visit the <a href="%s">WordPress support forums</a>.'=>'თუ არ იცით, რას ნიშნავს ეს ტერმინები &#8212; მიმართეთ ჰოსტინგის მომწოდებელს. თუ პრობლემა კვლავაც არსებობს, მიიღეთ დახმარება <a href="%s">WordPress-ის მხარდაჭერის ფორუმებზე</a>.','Error reconnecting to the database'=>'შეცდომა მონაცემთა ბაზასთან ხელახალი კავშირისას','This means that the contact with the database server at %s was lost. This could mean your host&#8217;s database server is down.'=>'ეს ნიშნავს, რომ კავშირი მონაცემთა ბაზის სერვერთან %s მისამართზე დაკარგულია. შესაძლოა, სერვერი მიუწვდომელია.','Are you sure the database server is not under particularly heavy load?'=>'დარწმუნებული ხართ, რომ მონაცემთა ბაზის სერვერი დატვირთული არ არის?','Are you sure the database server is running?'=>'დარწმუნებული ხართ, რომ მონაცემთა ბაზის სერვერი მუშაობს?','Are you sure you have typed the correct hostname?'=>'დარწმუნებული ხართ, რომ სერვერის სწორი სახელი შეიტანეთ?','Are you sure you have the correct username and password?'=>'დარწმუნებული ხართ, რომ სწორი მომხმარებლის სახელი და პაროლი მიუთითეთ?','This either means that the username and password information in your %1$s file is incorrect or that contact with the database server at %2$s could not be established. This could mean your host&#8217;s database server is down.'=>'ეს ნიშნავს, რომ ან მომხმარებლის სახელი და პაროლი არასწორია %1$s ფაილში, ან ჩვენ ვერ შევძელით მონაცემთა ბაზის სერვერთან კავშირი %2$s მისამართზე. შესაძლოა, სერვერი მიუწვდომელია.','If you do not know how to set up a database you should <strong>contact your host</strong>. If all else fails you may find help at the <a href="%s">WordPress support forums</a>.'=>'თუ არ იცით, როგორ მოარგოთ მონაცემთა ბაზასტან კავშირი, მიმართეთ <strong>ჰოსტინგის მომწოდებელს</strong>. თუ პრობლემა კვლავაც არსებობს &#8212; შესაძლოა დახმარება მიიღოთ <a href="%s">WordPress-ის მხარდაჭერის ფორუმებზე</a>.','Are you sure it exists?'=>'დარწმუნებული ხართ, რომ ის არსებობს?','Does the user %1$s have permission to use the %2$s database?'=>'აქვს მომხმარებელს %1$s უფლება გამოიყენოს მონაცემთა ბაზა %2$s?','On some systems the name of your database is prefixed with your username, so it would be like <code>username_%1$s</code>. Could that be the problem?'=>'ზოგიერთ სისტემაში მონაცემთა ბაზის სახელს ემატება მომხმარებლის სახელი პრეფიქსის სახით, დაახლოებით ასეთი რამ გამოდის <code>username_%1$s</code>. შესაძლოა, ეს არის მიზეზი?','The tag cloud will not be displayed since there are no taxonomies that support the tag cloud widget.'=>'ჭდეების ღრუბელი არ გამოჩნდება, ვინაიდან არცერთი ტაქონომია მას მხარს არ უჭერს.','Nicename may not be longer than 50 characters.'=>'მომხმარებლის მალსახმობი არ შეიძლება 50 სიმბოლოზე მეტი იყოს.','<strong>Error:</strong> The password you entered for the username %s is incorrect.'=>'<strong>შეცდომაა</strong>: შეტანილი პაროლი მომხმარებლისათვის %s არასწორია.','Categories list navigation'=>'კატეგორების სიაში ნავიგაცია','Categories list'=>'კატეგორების სია','Tags list navigation'=>'ჭდეების სიაში ნავიგაცია','Tags list'=>'ჭდეების სია','%1$s (since %2$s; no alternative available)'=>'%1$s (ვერსია %2$s; ალტერნატივის გარეშე)','%1$s (since %2$s; %3$s)'=>'%1$s (ვერსია %2$s; %3$s)','Invalid shortcode name: Empty name given.'=>'არასწორი შორტკოდის სახელი: მითითებულია ცარიელი სახელი.','Invalid shortcode name: %1$s. Do not use spaces or reserved characters: %2$s'=>'არასწორი შორტკოდის სახელი: %1$s. არ გამოიყენოთ ჰარი, ან დარეზერვებული სიმბოლოები: %2$s','%1$s (since %2$s; use %3$s instead)'=>'%1$s (ვერსია %2$s; გამოიყენეთ %3$s)','The specified namespace could not be found.'=>'მოთხოვნილი სახელთა სივრცე  ვერ მოიძებნა.','No route was found matching the URL and request method.'=>'ვერ მოიძებნა შესაბამისი სვლაგეზი და მოთხოვნის მეთოდი URL-მისამართისათვის.','In %1$s, use the %2$s method, not the %3$s function. See %4$s.'=>'%1$s-ში გამოიყენეთ %2$s მეთოდი %3$s ფუნქციის ნაცვლად. იხ. %4$s.','Missing parameter(s): %s'=>'მიუწვდომელი პ