%2$s','This site has been archived or suspended.'=>'საიტი დაარქივდა და გაიყინა.','The site you have requested is not installed properly. Please contact the system administrator.'=>'მოთხოვნილი საიტი არ არის მართებულად ჩაყენებული. გთხოვთ დაუკავშირდეთ სისტემის ადმინისტრატორს.','The given object ID is not that of a menu item.'=>'მოცემული ობიექტის ID არ შეესაბამება მენიუს ელემენტს.','The Site address you entered did not appear to be a valid URL. Please enter a valid URL.'=>'თქვენს მიერ მოწოდებული მისამართი არ არის მართებული URL-მისამართი. გთხოვთ შეიყვანოთ მართებული URL-მისამართი.','The WordPress address you entered did not appear to be a valid URL. Please enter a valid URL.'=>'თქვენს მიერ მოწოდებული WordPress-მისამართი არ არის მართებული URL-მისამართი. გთხოვთ შეიყვანოთ მართებული URL-მისამართი.','The email address entered did not appear to be a valid email address. Please enter a valid email address.'=>'ელფოსტის ეს მისამართი არ არის მართებული. გთხოვთ შეიყვანოთ ვარგისი მისამართი.','A term with the name provided already exists with this parent.'=>'ელემენტი მოყვანილი სახელწოდებათ ამ მშობელს უკვე გააჩნია.','An error occurred adding you to this site. Go to the <a href="%s">homepage</a>.'=>'მოხდა შეცდომა თქვენი ამ საიტზე დამატებისას. გადადით უკან <a href="%s">მთავარ გვერდზე</a>.','Your email address will not be published.'=>'თქვენი ელფოსტის მისამართი გამოქვეყნებული არ იყო.','A valid URL was not provided.'=>'მოწოდებულია უვარგისი ბმული.','Could not calculate resized image dimensions'=>'ზომა შეცვლილი გამოსახულების ზომების გამოთვლა შეუძლებელია','Completed <span class="count">(%s)</span>'=>'დასრულებული <span class="count">(%s)</span>','You are logged in already. No need to register again!'=>'თქვენ უკვე შეხვედით საიტზე. ხელმეორედ რეგისტრაცია არ არის საჭირო!','You must first <a href="%s">log in</a>, and then you can create a new site.'=>'ჯერ უნდა <a href="%s">შეხვიდეთ სისტემაში</a> და მერე შექმნათ ახალი საიტი.','Must be at least 4 characters, letters and numbers only. It cannot be changed, so choose carefully!'=>'უნდა იყოს არა ნაკლებ 4 სიმბოლო, მხოლოდ ასოები და ციფრები. ამ მნიშვნელობის შეცვლა მოგვიანებით შეუძლებელია, ყურაღებით იყავით!','This action has been disabled by the administrator.'=>'ეს ქმედება გათიშულია ადმინისტრატორის მიერ.','Welcome back, %s. By filling out the form below, you can <strong>add another site to your account</strong>. There is no limit to the number of sites you can have, so create to your heart&#8217;s content, but write responsibly!'=>'კეთილი იყოს თქვენი დაბრუნება, %s. ქვემოთ მოცემული ფორმის შევსებით თქვენ შეძლებთ <strong>კიდევ ერთი საიტის შექმნას</strong>. საიტების რაოდენობა არ არის შეზღუდული!','Page %s'=>'გვერდი %s','Briefly unavailable for scheduled maintenance. Check back in a minute.'=>'დროებით მიუწვდომელია დაგეგმილი მოწესრიგების გამო. დაგვიბრუნდით ცოტა ხანში.','Maintenance'=>'მოწესრიგება','Navigation Menus'=>'ნავიგაციის მენიუები','Navigation Menu Item'=>'ნავიგაციის მენიუს ელემენტი','Navigation Menu Items'=>'ნავიგაციის მენიუს ელემენტები','Links for %s'=>'ბმულები: %s','No menus have been created yet. <a href="%s">Create some</a>.'=>'მენიუები შექმნილი არ არის. <a href="%s">შექმენით რამდენიმე</a>.','This is the short link.'=>'ეს არის მოკლე ბმული.','%d WordPress Update'=>'%d WordPress-ის განახლება','%d Plugin Update'=>'%d პლაგინის განახლება','%d Theme Update'=>'%d თემის განახლება','Site registration has been disabled.'=>'საიტების რეგისტრაცია გამორთულია.','If you do not activate your site within two days, you will have to sign up again.'=>'თუ არ გააქტიურებთ თქვენს საიტს ორი დღის განმავლობაში, ხელმეორედ მოგიწევთ რეგისტრაცია.','But, before you can start using your site, <strong>you must activate it</strong>.'=>'მაგრამ, სანამ შეძლებთ თქვენი საიტით სარგებლობას, <strong>საჭირო იქნება მისი გააქტიურება</strong>.','Congratulations! Your new site, %s, is almost ready.'=>'გილოცავთ! თქვენი ახალი საიტი, %s, თითქმის მზად არის.','Gimme a site!'=>'მომეცით საიტი!','The site %s is yours.'=>'საიტი %s თქვენია.','Create Site'=>'საიტის შექმნა','If you are not going to use a great site domain, leave it for a new user. Now have at it!'=>'თუ არ აპირებთ შესანიშნავი დომენის გამოყენებას, დაუტოვეთ ის სხვებს. ახლა კი დაიწყეთ!','Sites you are already a member of:'=>'საიტები, რომლებზეც უკვე ხართ წევრი:','Get <em>another</em> %s site in seconds'=>'მიიღეთ <em>კიდევ ერთი</em> %s საიტი სულ რაღაც წამებში','Site Title:'=>'საიტის სათაური:','sitename'=>'საიტის სახელი','File canceled.'=>'ჩატვირთვა გაუქმებულია.','New pingback on your post "%s"'=>'ახალი შეტყობინება თქვენი ჩანაწერის შესახებ: "%s"','New trackback on your post "%s"'=>'ახალი უკუბმული თქვენ ჩანაწერზე: "%s"','If your site does not display, please contact the owner of this network.'=>'თუ თქვენი საიტი არ ჩანს, დაუკავშირდით ამ ქსელის ადმინისტრატორს.','New comment on your post "%s"'=>'ახალი კომენტარი “%s”','A new trackback on the post "%s" is waiting for your approval'=>'ახალი კომენტარი ჩანაწერზე "%s" ელოდება გააქტიურებას','A new pingback on the post "%s" is waiting for your approval'=>'ახალი კომენტარი ჩანაწერზე "%s" ელოდება გააქტიურებას','A new comment on the post "%s" is waiting for your approval'=>'ახალი კომენტარი ჩანაწერზე "%s" ელოდება გააქტიურებას','Navigation Menu'=>'ნავიგაციის მენიუ','Select Menu:'=>'მენიუს არჩევა:','Taxonomy:'=>'ტაქსონომია:','One response to %s'=>'ერთი კომენტარი: %s','Search results for: "%s"'=>'ძებნის შედეგები %s','Menus'=>'მენიუები','Invalid post type.'=>'ჩანაწერის არასწორი ტიპი.','Your PHP installation appears to be missing the MySQL extension which is required by WordPress.'=>'PHP ინსტალაციისას გამორჩენილია MySQL მონაცემთა ბაზა რომელიც აუცილებელი WordPress-ის მუშაობისთვის.','The specified target URL does not exist.'=>'მითითებული მისამართი არ არსებობს.','Pingback from %1$s to %2$s registered. Keep the web talking! :-)'=>'შეტყობინება %1$s-დან %2$s-თვის ჩაწერილია. გააგრძელეთ საუბარი! :-)','The source URL does not contain a link to the target URL, and so cannot be used as a source.'=>'წყაროს მისამართი არ შეიცავს ბმულს მიზნის მისამართზე, ამიტო